dFolder) == 1 )\n                #set ($filename = $record.getField(\"name\").getValue())\n                #set ($recordId = $record.RecordId)\n                #set ($isDisabled = $record.getField(\"disabled\").getValue())\n                addFile(nodeData, \"$pathname\".split(\"/\"), \"$filename\", $recordId, $isDisabled);\n            #end\n        #end\n    #end\n      \n    $(function(){\n        $(\"#tree\").dynatree({\n            persist: true,\n            children: nodeData,\n            cookieId: \"$reserved_record_set_id-$userId\",\n            onCustomRender: function(node) {\n                if (!node.data.isFolder && node.data.disabled) {\n                    html = \"<a class=\'dynatree-title\' style=\'color: grey\' href=\'#\'>\";\n                }\n                else {\n                    html = \"<a class=\'dynatree-title\' href=\'#\'>\";\n                }\n                \n                html += node.data.title;\n\n                if (node.getLevel()==1) {\n                    if(node.data.title==\"AIL\") {\n                        html += \" <span style=\'color:darkblue; font-size:.8em\'>(accessible to all users)</span>\";\n                    }\n                    else if(node.data.title.indexOf(\"Insurance\")!=-1) {\n                        html += \" <span style=\'color:darkblue; font-size:.8em\'>(private to \"+node.data.title.split(\" \")[0]+\" staff)</span>\";\n                    }\n                    else {\n                        html += \" <span style=\'color:darkblue; font-size:.8em\'>(private to \"+node.data.title.split(\" \")[0]+\")</span>\";\n                    }\n                }\n                \n                return html + \"</a>\";\n            },\n            onActivate: function(node) {\n                if (!node.data.isFolder) {\n                    var url;\n                    url=document.URL;\n                    url=url.replace(/[?&]+recordId=\\d*/, \"\");\n                    url=url.replace(/[?&]+recordSet