INSERT INTO `JournalArticle` VALUES ('8b2302b4-c818-418e-909f-ab4d2bb9f8e4',23533,23534,10184,10157,10436,'Adam OpenUnderwriter','2013-12-03 18:01:40','2013-12-04 07:12:04',0,0,0,'/0/','23532',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Project Links</Title></root>','project-links','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div>OpenUnderwriter project resources</div>\n<div>\n				<ul>\n					<li>\n						<a href=\"http://openquote.opensourceinsurance.org/\" target=\"project_page\">Project home page</a></li>\n					<li>\n						<a href=\"http://sourceforge.net/projects/oquote\" target=\"project_page\">SourceForge project</a></li>\n					<li>\n						<a href=\"http://openquotecommunity.org/jira\" target=\"project_page\">Issue tracker</a></li>\n					<li>\n						<a href=\"http://openquote.opensourceinsurance.org/index.php/support/support-forum\" target=\"project_page\">Forums</a></li>\n					<li>\n						<a href=\"http://openquotecommunity.org/wiki\" target=\"project_page\">Wiki</a></li>\n					<li>\n						<a href=\"http://openquotecommunity.org/bamboo/\" target=\"project_page\">Build server</a></li>\n				</ul>\n</div>\n<div>\n				If you\'d like to get in contact with us, the <a href=\"http://openquote.opensourceinsurance.org/index.php/support/support-forum/forum?id=11\" target=\"project_page\">Open Discussion Forum</a> is an excellent place to start.</td>\n</div>]]></static-content>\n</root>','general','','','','2013-12-03 18:01:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2013-12-04 07:12:04'),('8aa482db-5dd2-427f-832f-03c3bf30b90d',24505,23545,22701,10157,10436,'Adam OpenUnderwriter','2013-12-08 19:12:09','2013-12-08 19:12:09',0,0,0,'/0/','23543',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Welcome</Title></root>','welcome','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div style=\"border-bottom: 1px solid #1D8412;margin-bottom:10px;\">\n	Welcome to OpenActuary</div>\n<p>\n	OpenActuary is an open source shared actuarial data repository. It provides facilities to allow actuarial information and reports to be built and shared both within an organisation and across organisations. Information from an organisation\'s internal systems is extracted, translated and loaded into OpenActuary\'s staging areas. Once validated, it is then loaded into a shared master database. Reports are authored and run against this data and extracts provided for further analysis by actuaries.</p>\n<p>\n	OpenActuary is part of the <a href=\"/welcome\">OpenUnderwriter</a> product suite.</p>\n<div style=\"border-bottom: 1px solid #1D8412;margin-bottom:10px;\">\n	Sample Users</div>\n<p>\n	This version of OpenActuary is setup with a number of sample users. OpenActuary is designed to serve the needs of a number of different types of users. The primary type of user might be considered to be the actuary, but the system also supports company executives, organisation administrators, as well as developers working on reporting and ETL. Each of these types of user has specific needs in terms of the functionality they access, so each receives a tailored experience. Also, each user is associated with a specific insurance company and this defines their access rights to data and reports.</p>\n<p>\n	The pilot defines two companies: Metropolitan Insurance and Star Insurance. For each of these companies it also defines a complete set of users. As well as these, there are also users defined for OpenActuary administrative roles of Report and ETL administrator and system administrator.</p>]]></static-content>\n</root>','general','','','','2013-12-03 18:02:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2013-12-08 19:12:09'),('bb4d0318-6aa1-4fd8-a08f-ae9cc20c9f31',25816,23510,10184,10157,10436,'Adam OpenUnderwriter','2013-12-15 12:13:46','2013-12-15 12:13:46',0,0,0,'/0/','23508',2.8,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Welcome</Title></root>','welco-1','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<p>\nOpenUnderwriter is a suite of web enabled open source insurance applications which can work independently of each other, or together. The suite provides support for the full insurance lifecycle.</p>\n<p>\nUse the links below to access the applications areas of this OpenUnderwriter installation.</p>\n<br/>\n<div class=\"ou-icon-strip\" id=\"login-strip\" style=\"max-width: 905px;\">\n	<div style=\"width: 905px;\">\n		<div class=\"ou-icon-strip-section\">\n			<div class=\"ou-icon-strip-icon\" style=\"background-size:100%;height:190px;width:190px;background-image: url(/documents/10197/13653/icon+png+OpenQuote+h480px.png/1225365c-6355-46ff-9b5a-c329b61164ef?t=1386091421000)\">\n				<a href=\"/en_GB/web/oq\" style=\"display: block; width: 180px; height: 180px\">\n					<img alt=\"\" src=\"/documents/10197/13653/logo+png+OpenQuote+h50px.png/2f1b1b49-8e83-44d1-9ee3-301e43b7a11c?t=1386091417000\" style=\"width: 151px; height: 28px; margin: 8px;\" /><br />\n					<p>Policy distribution application allows products to be built and sold online. Includes rating and premium transactions.</p>\n					<p style=\"color:#f00\">Released</p>\n				</a>\n			</div>\n			<div class=\"ou-icon-strip-icon\" style=\"background-size:100%;height:190px;width:190px;background-image: url(/documents/10197/13653/icon+png+OpenActuary+h480px.png/a3eaab6d-a89a-4240-b29e-e8c9448a8c66?t=1386091421000)\">\n				<a href=\"/en_GB/web/oa\" style=\"display: block; width: 180px; height: 180px\">\n					<img alt=\"\" src=\"/documents/10197/13653/logo+png+OpenActuary+h50px.png/0a8dfe4a-0032-4ec4-9acb-292960329cb4?t=1386091416000\" style=\"width: 173px; height: 28px; margin: 8px;\" /><br />\n					<p>Actuarial research data repository. Provides reports and import, export/extract support for industry and insurer analysis.</p>\n					<p style=\"color:#f00\">In pilot</p>\n				</a>\n			</div>\n			<div class=\"ou-icon-strip-icon\" style=\"background-size:100%;height:190px;width:190px;background-image: url(/documents/10197/13653/icon+png+OpenPolicy+h480px.png/baf5424e-14fd-40bd-a68b-cf501c29948d?t=1386091421000)\">\n				<img alt=\"\" src=\"/documents/10197/13653/logo+png+OpenPolicy+h50px.png/dd9f863e-cea8-4a13-816e-3a16968a59a7?t=1386091417000\" style=\"width: 151px; height: 28px; margin: 8px;\" /><br />\n				<p>Full policy life-cycle support. Products are extended to cover mid term adjustment, renewal and cancellation transactions.</p>\n				<p style=\"color:#f00\">In development</p>\n			</div>\n			<div class=\"ou-icon-strip-icon\" style=\"background-size:100%;height:190px;width:190px;background-image: url(/documents/10197/13653/icon+png+OpenClaim+h480px.png/ba3f1b48-89c1-480a-ba43-be88ad9717a4?t=1386091421000)\">\n				<img alt=\"\" src=\"/documents/10197/13653/logo+png+OpenClaim+h50px.png/28da20cf-92f3-415a-9b84-24503cece488?t=1386091416000\" style=\"width: 147px; height: 28px; margin: 8px;\" /><br />\n				<p>A Claims management tool. Provides support for claims processes from first notification through to payment.</p>\n				<p style=\"color:#f00\">Concept</p>\n			</div>\n		</div>\n	</div>\n</div>\n<br /><br.>\n<p>\n	OpenUnderwriter is distributed under the <a href=\"http://opensource.org/licenses/gpl-3.0.html\" target=\"_blank\">GNU General Public License</a>. This means you can download it and use it freely without charge as long as you comply with that license.</p>\n<p>\n	Free community support for OpenUnderwriter is available via our <a href=\"http://www.openunderwriter.com/index.php/support/community\">support forum</a>, which compliments our wider <a href=\"http://www.openunderwriter.com/index.php/support/support-options\">commercial support and value added service offerings</a>. For more information please <a href=\"http://www.openunderwriter.com/index.php/contact\">contact us</a>.</p>]]></static-content>\n</root>','general','','','','2013-12-03 17:59:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2013-12-15 12:13:46'),('4cb59386-edfb-43c1-b429-dd2b133f3ece',38615,23524,10184,10157,10436,'Adam OpenUnderwriter','2014-02-19 07:39:42','2014-02-19 07:39:42',0,0,0,'/0/','23522',2.4,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Login Strip</Title></root>','login-strip','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div class=\"ou-icon-strip\" id=\"login-strip\" style=\"max-width:1970px\">\n	<div style=\"width: 1970px;\">\n		<div class=\"ou-icon-strip-section\">\n			<div style=\"text-align: center\">OpenUnderwriter Users</div>\n\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick=\"login(\'adam\')\" style=\"display: block;\"> <img alt=\"\"\n					src=\"/documents/10197/13602/anonymous_male_profile.jpeg/454474b9-c8aa-44f8-8a72-6c58c816cf29?t=1386091415000\"\n					style=\"width: 75px; height: 75px;\" />\n\n					<div class=\"ou-name\">Adam</div>\n\n					<div class=\"ou-title\">Administrator</div>\n				</a>\n			</div>\n\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick=\"login(\'emily\')\" style=\"display: block;\"> <img alt=\"\"\n					src=\"/documents/10197/13602/anonymous_female_profile.jpeg/cb03bb39-18fc-49d4-85d3-8d1f157b6acc?t=1386091415000\"\n					style=\"width: 75px; height: 75px;\" />\n\n					<div class=\"ou-name\">Emily</div>\n\n					<div class=\"ou-title\">\n						ETL<br />Administrator\n					</div>\n				</a>\n			</div>\n\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick