\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick=\"login(\'oliver\')\"> <img alt=\"\" src=\"/documents/10197/13602/anonymous_male_profile.jpeg/454474b9-c8aa-44f8-8a72-6c58c816cf29?t=1386091415000\" style=\"width: 75px; height: 75px; \" />\n				<div class=\'ou-name\'>Oliver</div>\n				<div class=\'ou-title\'>Report<br/>Developer</div></a></div>\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick=\"login(\'charlie\')\"> <img alt=\"\" src=\"/documents/10197/13602/anonymous_female_profile.jpeg/cb03bb39-18fc-49d4-85d3-8d1f157b6acc?t=1386091415000\" style=\"width: 75px; height: 75px; \" />\n				<div class=\'ou-name\'>Charlie</div>\n				<div class=\'ou-title\'>Organisation<br/>Administrator</div></a></div>\n		</div>\n		<div class=\"ou-icon-strip-divider\">\n			&nbsp;</div>\n		<div class=\"ou-icon-strip-section\">\n			<div style=\"text-align:center\">\n				Star Insurance Company Users</div>\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick=\"login(\'george\')\"> <img alt=\"\" src=\"/documents/10197/13602/anonymous_male_profile.jpeg/454474b9-c8aa-44f8-8a72-6c58c816cf29?t=1386091415000\" style=\"width: 75px; height: 75px; \" />\n				<div class=\'ou-name\'>George</div>\n				<div class=\'ou-title\'>Actuary</div></a></div>\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick=\"login(\'isabelle\')\"> <img alt=\"\" src=\"/documents/10197/13602/anonymous_female_profile.jpeg/cb03bb39-18fc-49d4-85d3-8d1f157b6acc?t=1386091415000\" style=\"width: 75px; height: 75px; \" />\n				<div class=\'ou-name\'>Isabelle</div>\n				<div class=\'ou-title\'>Executive</div></a></div>\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick=\"login(\'thomas\')\"> <img alt=\"\" src=\"/documents/10197/13602/anonymous_male_profile.jpeg/454474b9-c8aa-44f8-8a72-6c58c816cf29?t=1386091415000\" style=\"width: 75px; height: 75px; \" />\n				<div class=\'ou-name\'>Thomas</div>\n				<div class=\'ou-title\'>ETL<br/>Developer</div></a></div>\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick=\"login(\'sophie\')\"> <img alt=\"\" src=\"/documents/10197/13602/anonymous_female_profile.jpeg/cb03bb39-18fc-49d4-85d3-8d1f157b6acc?t=1386091415000\" style=\"width: 75px; height: 75px; \" />\n				<div class=\'ou-name\'>Sophie</div>\n				<div class=\'ou-title\'>Report<br/>Developer</div></a></div>\n			<div class=\"ou-icon-strip-icon\">\n				<a onclick=\"login(\'ethan\')\"> <img alt=\"\" src=\"/documents/10197/13602/anonymous_male_profile.jpeg/454474b9-c8aa-44f8-8a72-6c58c816cf29?t=1386091415000\" style=\"width: 75px; height: 75px; \" />\n				<div class=\'ou-name\'>Ethan</div>\n				<div class=\'ou-title\'>Organisation<br/>Administrator</div></a></div>\n		</div>\n	</div>\n</div>]]></static-content>\n</root>','general','','','','2013-12-03 18:03:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2014-02-23 13:38:25'),('865edbf0-43fb-4648-b5cf-4a1a96f1a4d1',40805,40806,22705,10157,10436,'Adam OpenUnderwriter','2014-03-18 17:34:45','2014-03-18 17:34:46',0,0,0,'/0/','40804',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Welcome</Title></root>','welco-1','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div style=\"border-bottom: 1px solid #1D8412; margin-bottom: 10px;\">\n	Welcome to OpenQuote</div>\n<p>OpenQuote is the Open Source solution for providing insurance\n	quotations over the web. Using a web interface, insurance companies can\n	define any number of products or schemes to support any line of\n	business. These can then be made instantly available for quotation to\n	any proposer or other insurance intermediary who has web access.</p>\n<p>\n	OpenQuote is Open Source; distributed under the <a\n		href=\"http://opensource.org/licenses/gpl-3.0.html\" target=\"_blank\">GNU\n		General Public License</a>. This means you can download it and use it\n	freely without charge - as long as you comply with that license. Free\n	community support for OpenUnderwriter is available via our <a\n		href=\"http://www.openunderwriter.com/index.php/support/community\">support\n		forum</a>, which compliments our wider <a\n		href=\"http://www.openunderwriter.com/index.php/support/support-options\">commercial\n		support and value added service offerings</a>. For more information please\n	<a href=\"http://www.openunderwriter.com/index.php/contact\">contact\n		us</a>.\n</p>\n<p>\n	OpenQuote is part of the <a href=\"/welcome\">OpenUnderwriter</a> product\n	suite.\n</p>]]></static-content>\n</root>','general','','','','2014-03-18 17:34:00',NULL,NULL,1,0,40807,'',0,10436,'Adam OpenUnderwriter','2014-03-18 17:34:46'),('a65824c8-45d5-4be2-988c-edd25e9bd761',40831,40832,22705,10157,10436,'Adam OpenUnderwriter','2014-03-18 17:36:27','2014-03-18 17:36:27',0,0,0,'/0/','40830',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Sample Users</Title></root>','sample-users','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[]]></static-content>\n</root>','general','','','','2014-03-18 17:36:00',NULL,NULL,1,0,40833,'',0,10436,'Adam OpenUnderwriter','2014-03-18 17:36:27'),('20860cca-6e02-4dcb-9bc7-a2d4d2d52bc2',40841,40832,22705,10157,10436,'Adam OpenUnderwriter','2014-03-18 17:36:39','2014-04-15 15:01:33',0,0,0,'/0/','40830',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Sample Users</Title></root>','sample-users','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div style=\"border-bottom: 1px solid #1D8412; margin-bottom: 10px;\">\n	Sample Users</div>\n<p>The default installation of OpenQuote includes a number of sample\n	users to help demonstrate its features. You can login with these users\n	from the Quick Demo Sign In portlet to the right. This gives you access\n	to two types of user:</p>\n<ul>\n	<li>\n		<p>\n			As a <b>Product Developer</b> you can modify any feature of a product\n			or create completely new products. Two Product Manager are defined,\n			one for each of the demonstration organisations: Metropolitan\n			Insurance and Star Insurance. Each user has permission to edit their\n			organisation\'s products.\n		</p>\n	</li>\n	<li>\n		<p>\n			As a <b>Product Administrator</b> You can perform all of the\n			functions of a Product Developer, but have additional privileges and\n			administrative responsibilities.\n		</p>\n	</li>\n	<li>\n		<p>\n			As an <b>Administrator</b> you have complete access to the internals\n			of the system. You can add/remove users, administer windows, pages,\n			or even create completely new portals.\n		</p>\n	</li>\n</ul>\n<p>&nbsp;</p>]]></static-content>\n</root>','general','','','','2014-03-18 17:36:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2014-04-15 15:01:33'),('c762e2d6-1032-4564-87f3-168ec850910a',40984,40817,22705,10157,10436,'Adam OpenUnderwriter','2014-03-18 23:02:21','2014-04-15 15:01:33',0,0,0,'/0/','40815',2.6,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Product Strip</Title></root>','product-strip','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<script src=\"/html/js/dynatree/jquery.js\"></script>\n<div style=\"border-bottom: 1px solid #1D8412; margin-bottom: 10px;\">\n	Try a sample product</div>\n<p>\n	OpenQuote comes with a number of pre-built sample products to give a feel for its capabilities. You can get try these right now by clicking the links below. The full product definitions and all of the supporting resources are also included and can be found in the Product Manager (see below).</p>\n<div style=\"position:relative\">\n	<div class=\"ou-icon-strip\" id=\"product-strip\" style=\"max-width: 1450px;\">\n		<div style=\"width: 1450px;min-height:340px;\">\n			<div class=\"ou-icon-strip-section\">\n				<div class=\"ou-icon-strip-icon\" style=\"width:250px; height:290px;\">\n					<a href=\"http://lifeplus.localhost:8080\" style=\"display: block; width:250px; \">\n						<img alt=\"\" src=\"/documents/22705/0/LifePlusThumb.png/83f31829-2b57-4334-bb49-8a5db95fd688?t=1386092330000\" style=\"width: 226px; height: 169px;\" />\n						<p><b>LifePlus</b></p>\n						<p>A simple product based on Term Life. This is a good place to start learning the concepts of OpenQuote.</p>\n					</a>\n				</div>\n				<div class=\"ou-icon-strip-icon\" style=\"width:250px; height:290px;\">\n					<a href=\"http://irishbrokerpi.localhost:8080\" style=\"display: block; width:250px;\">\n						<img alt=\"\" src=\"/documents/22705/0/IrishBrokerPIThumb.png/61e44084-8b78-43b1-8e84-aac404ee8cda?t=1386092330000\" style=\"width: 226px; height: 177px;\" />\n						<p><b>Irish Broker PI</b></p>\n						<p>A product built in conjunction with City Net a London City broker. Most of the portal is open access, but to see the quotation tab you will need to login as <strong>broker</strong> (password also \'broker\').</p>\n					</a>\n				</div>\n				<div class=\"ou-icon-strip-icon\" style=\"width:250px; height:290px;\">\n					<a href=\"http://motorplus.localhost:8080\"  style=\"display: block; width:250px;\">\n						<img alt=\"\" src=\"/documents/22705/0/MotorPlusThumb.png/0183f87e-e7fe-4a32-a9e7-ed69148720ca?t=1386092331000\" style=\"width: 226px; height: 168px;\" />\n						<p><b>MotorPlus</b></p>\n						<p>A reasonably complex personal motor product. Offers support for multiple drivers and multiple vehicles with four pages of rating questions in total.</p>\n					</a>\n				</div>\n				<div class=\"ou-icon-strip-icon\" style=\"width:250px; height:290px;\">\n					<a href=\"http://equineplus.localhost:8080\" style=\"display: block; width:250px;\">\n						<img alt=\"\" src=\"/documents/22705/0/EquinePlusThumb.png/8556793d-ced9-455e-95e0-7dc8d2885cab?t=1386092325000\" style=\"width: 226px; height: 169px;\" />\n						<p><b>EquinePlus</b></p>\n						<p href=\"/web/equineplus\">Private horse insurance product offering cover for riding equipment and the horse.</p>\n					</a>\n				</div>\n				<div class=\"ou-icon-strip-icon\" style=\"width:250px; height:290px;\">\n					<a href=\"http://freightplus.localhost:8080\" style=\"display: block; width:250px;\">\n						<img alt=\"\" src=\"/documents/22705/0/FreightPlusThumb.png/089d1e78-5fbf-4045-977c-e58755c4e41b?t=1386092329000\" style=\"width: 226px; height: 155px;\" />\n						<p><b>FreightPlus</b></p>\n						<p>A personal freight shipping product. This product quotes based on just four question.</p>\n					</a>\n				</div>\n			</div>\n		</div>\n	</div>\n	<div id=\"unavailable\" style=\"display:none;position: absolute;left: 5%;top: 3%;right: 5%;bottom: 3%;z-index: 90;background-color: rgb(170, 255, 170);opacity: 0.7;padding:20px;font-size:3em;line-height:1.5em;text-align: center;overflow-y: scroll;\">\n		The sample product sites are not currently accessible on your server.<br/> <a\n			href=\"/web/oq/help?p_p_id=54_INSTANCE_Jn1ZSv7UjIOf&amp;_54_INSTANCE_Jn1ZSv7UjIOf_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_Jn1ZSv7UjIOf_nodeName=Main&_54_INSTANCE_Jn1ZSv7UjIOf_title=Configuring+the+demonstration+product+sites\">Click here to find out how to fix this.</a>\n	</div>\n	<img src=\"http://lifeplus.localhost:8080/documents/11252/0/Pixel.png/cff60b22-5d56-4edd-8e6c-379ce85b3024?t=1395165098778\" onerror=\"$(this).hide(); $(\'#unavailable\').show()\" />\n</div>]]></static-content>\n</root>','general','','','','2014-03-18 17:35:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2014-04-15 15:01:33'),('32e680f7-7cd3-4498-b905-7cecdf391831',41812,41813,10184,10157,10436,'Adam OpenUnderwriter','2014-04-18 23:11:26','2014-04-18 23:11:26',0,0,0,'/0/','41811',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Feedback</Title></root>','feedback','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<h2 style=\"margin: 0px 0px 13px; font-family: Arial;\">Thank you</h2>\n\n<p style=\"margin: 0px 0px 13px; font-family: Arial;\">We very much appreciate your feedback. It helps us to ensure the future of the project and to focus the project\'s direction to best suit the people using it. It also helps to encourage the team of developers and analysts who contribute to OpenUnderwriter on an entierly&nbsp;voluentary basis. Knowing that out work is of value to others is a huge motivation.</p>\n\n<p style=\"margin: 0px 0px 13px; font-family: Arial;\">Please feel free to give as much or as little information as you feel comfortable in doing. We are particularly interested to know more about&nbsp;your experiences with the system, your organisation and its requirements. The more information that we have the more able we are to develope the features that you need.&nbsp;</p>\n\n<p style=\"margin: 0px 0px 13px; font-family: Arial;\">All the information that you supply will be treated in the strictest confidence and will only be used within the project. We&nbsp;will not&nbsp;shared it with any 3rd party.</p>]]></static-content>\n</root>','general','','','','2014-04-18 23:10:00',NULL,NULL,1,0,41814,'',0,10436,'Adam OpenUnderwriter','2014-04-18 23:11:26'),('3e2baf71-b327-4ab7-bb15-b3468a2a2473',42158,42159,42001,10157,10436,'Adam OpenUnderwriter','2014-04-22 06:40:09','2014-04-22 06:40:09',0,0,0,'/0/','42157',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Life Plus Links</Title></root>','life-plus-links','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<table border=\"0\" width=\"100%\">\n	<tbody>\n		<tr>\n			<td>\n			<p><a href=\"/welcome\">Life Plus</a> - Get a quote, or manage quotes you\'ve saved. You may find a cheaper quote elsewhere, but you won\'t find better value.</p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p><a href=\"/about-us\">About Us</a> - More about us and how our in-depth knowledge, expert advice and state-of-the-art technology can help you.</p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p><a href=\"/about-life-plus\">About Life Plus</a> - The most innovitive term life product on the market today. How does it compare to the oppisition? How can we guarantee that our offering is the best?</p>\n			</td>\n		</tr>\n	</tbody>\n</table>]]></static-content>\n</root>','general','','','','2014-04-22 06:39:00',NULL,NULL,1,0,42160,'',0,10436,'Adam OpenUnderwriter','2014-04-22 06:40:09'),('ac0f5fc6-77d2-4fc8-80cf-96ebd69ba33d',42224,42225,42001,10157,10436,'Adam OpenUnderwriter','2014-04-22 12:38:16','2014-04-22 12:38:16',0,0,0,'/0/','42223',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">About Us</Title></root>','about-us','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<p>Life Plus was fonded in 1861 by a Jacob Section, a wealthy mill owner from Smallclaim in the county of Covershire. As a Quaker, Jacob held a keen interest in the well being of those who worked in his mill and was appauled to find that almost none of his works had appropriate levels of life insurance. He created the Life Plus product to meet this need and in so doing made his workers very grateful indeed.</p>\n\n<p>Jacob died in 1878 but by this time Life Plus was well known and respected among the mill owners and workers of Covershire for offering very competitive leves of cover for extreemly reasonable premiums. His son, Homer Section took over the business and saw it grow throughout his life time. Following his marrage to Constants Policy the business diversified to also offer Homer and Constants insurance, but following the 1882 chip pan crisis this side of the business was sold.</p>\n\n<p>The solid principals upon which Jacob founded the business remain our core values today. Our mission statement \"We sell life insurance\" captures the mood and drive of the organisation prefectly.</p>\n\n<p>Over the years, life plus has won many awards for innovation and excellence, including biggest pancake of the year at the 1932 Covershire fair.</p>]]></static-content>\n</root>','general','','','','2014-04-22 12:37:00',NULL,NULL,1,0,42226,'',0,10436,'Adam OpenUnderwriter','2014-04-22 12:38:16'),('06bb9a8b-1439-4688-9c2d-7025cb0773fd',42578,42173,42001,10157,10436,'Adam OpenUnderwriter','2014-04-22 16:26:07','2014-04-22 16:26:07',0,0,0,'/0/','42171',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Testimonials</Title></root>','testimonials','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<table border=\"0\" width=\"100%\">\n	<tbody>\n		<tr>\n			<td align=\"center\">&nbsp;<img alt=\"\" src=\"/documents/42001/0/Jane+Smile.png/c176c134-cd03-4864-93cc-dc5605ada144?t=1398148029000\" /></td>\n			<td align=\"center\" colspan=\"2\">&nbsp;<em style=\"color: rgb(102, 102, 102); text-align: left;\">\"This is the best damned term life policy I\'ve ever had. Life Plus saved me thousands of pounds and made my carpet smell good too!</em><span style=\"color: rgb(102, 102, 102); text-align: left;\">\"</span><strong style=\"color: rgb(102, 102, 102); text-align: left;\">- Jane Smile</strong></td>\n		</tr>\n		<tr>\n			<td align=\"center\" colspan=\"2\">&nbsp;\n			<p><em>\"If you only buy one term life product this year, make it Life Plus. You, your family and your descendants for several generations will thank you for it.</em>\"<strong>- Jimbo Greenshirt</strong></p>\n			</td>\n			<td align=\"center\">&nbsp;<img alt=\"\" src=\"/documents/42001/0/Jimbo+Greenshirt.png/75f3d607-d8a7-478d-9209-b4b6ccc7f56f?t=1398148029000\" /></td>\n		</tr>\n	</tbody>\n</table>]]></static-content>\n</root>','general','','','','2014-04-22 06:40:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2014-04-22 16:26:07'),('0bc9ae00-6736-4869-9056-1518cf3baae2',42583,42184,42001,10157,10436,'Adam OpenUnderwriter','2014-04-22 16:26:32','2014-04-22 16:26:32',0,0,0,'/0/','42182',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Banner</Title></root>','banner','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<img alt=\"\" src=\"/documents/42001/0/Banner.png/96473999-d13f-4951-bf3b-d2c81ed5e527?t=1398148029000\" style=\"width: 777px; height: 253px;\" />]]></static-content>\n</root>','general','','','','2014-04-22 06:42:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2014-04-22 16:26:32'),('959e012b-67cb-4b3b-9e55-8cc7ffe69532',42588,42208,42001,10157,10436,'Adam OpenUnderwriter','2014-04-22 16:27:45','2014-04-22 16:27:45',0,0,0,'/0/','42206',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">About Life Plus</Title></root>','about-life-plus','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<table border=\"0\" width=\"100%\">\n	<tbody>\n		<tr>\n			<td valign=\"top\"><img alt=\"\" src=\"/documents/42001/0/Question+Mark.png/b430ff0f-1c51-447e-b265-6740535fd296?t=1398148030000\" style=\"min-width: 83px; height: 83px;\" /></td>\n			<td>\n			<h1>What is Term Life insurance?</h1>\n\n			<p>Term life insurance&nbsp;or&nbsp;term assurance&nbsp;is&nbsp;<a href=\"http://en.wikipedia.org/wiki/Life_insurance\">life insurance</a>&nbsp;which provides coverage at a fixed rate of payments for a limited period of time, the relevant term. After that period expires coverage at the previous rate of premiums is no longer guaranteed and the client must either forgo coverage or potentially obtain further coverage with different payments and/or conditions. If the insured dies during the term, the death benefit will be paid to the&nbsp;<a href=\"http://en.wikipedia.org/wiki/Beneficiary\">beneficiary</a>. Term insurance is the most inexpensive way to purchase a substantial death benefit on a coverage amount per premium pound basis.</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\"><img alt=\"\" src=\"/documents/42001/0/Question+Mark.png/b430ff0f-1c51-447e-b265-6740535fd296?t=1398148030000\" style=\"width: 83px; height: 83px;\" /></td>\n			<td>\n			<h1>Term Life? Whole Life? Universal Life? I\'m confused!?</h1>\n\n			<p>Term life insurance is the original form of life insurance&nbsp;and can be contrasted to&nbsp;<a href=\"http://en.wikipedia.org/wiki/Permanent_life_insurance\">permanent life insurance</a>&nbsp;such as&nbsp;<a href=\"http://en.wikipedia.org/wiki/Whole_life_insurance\">whole life</a>,&nbsp;<a href=\"http://en.wikipedia.org/wiki/Universal_life_insurance\">universal life</a>, and&nbsp;<a href=\"http://en.wikipedia.org/wiki/Variable_universal_life_insurance\">variable universal life</a>, which guarantee coverage at fixed premiums for the lifetime of the covered individual. Many permanent life insurance products also build a predetermined cash value over the life of the contract, available for later withdrawal by the client under specific conditions. However, on most cash value policies like Whole Life insurance, the only way to receive the \"savings\" is to cash out the policy. The beneficiaries receive the face value of the insurance but NEVER the cash value with Whole Life policies. Financial advisers generally advise buying term life insurance and investing the difference elsewhere.</p>\n\n			<p>Term insurance functions in a manner similar to most other types of insurance in that it satisfies claims against what is insured if the premiums are up to date and the contract has not expired, and does not expect a return of Premium dollars if no claims are filed. As an example, auto insurance will satisfy claims against the insured in the event of an accident and a home owner policy will satisfy claims against the home if it is damaged or destroyed by, for example, an earthquake or fire. Whether or not these events will occur is uncertain, and if the policy holder discontinues coverage because he has sold the insured car or home the insurance company will not refund the premium. This is purely risk protection.</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\"><img alt=\"\" src=\"/documents/42001/0/Question+Mark.png/b430ff0f-1c51-447e-b265-6740535fd296?t=1398148030000\" style=\"width: 83px; height: 83px;\" /></td>\n			<td>\n			<h1>How can it be used?</h1>\n\n			<p>Because term life insurance is a pure death benefit, its primary use is to provide coverage of financial responsibilities, for the insured. Such responsibilities may include, but are not limited to, consumer debt, dependent care, college education for dependents, funeral costs, and mortgages. Term life insurance is generally chosen in favor of permanent life insurance because it is usually much less expensive (depending on the length of the term). Many financial advisors or other experts commonly recommend term life insurance as a means to cover potential expenses until such time that there are sufficient funds available from savings to protect those whom the insurance coverage was intended to protect. For exhttp://www.sxc.hu/profile/hisksample, an individual might choose to obtain a policy whose term expires near his or her retirement age based on the premise that, by the time the individual retires, he or she would have amassed sufficient funds in retirement savings to provide financial security for their dependents.</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>]]></static-content>\n</root>','general','','','','2014-04-22 12:35:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2014-04-22 16:27:45'),('520df175-2203-4584-bbd7-42e91311f075',43740,43324,43205,10157,10436,'Adam OpenUnderwriter','2014-04-22 21:51:00','2014-04-22 21:51:00',0,0,0,'/0/','43322',1.2,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Welcome</Title></root>','welcome','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<style type=\"text/css\">.classname {\n	-moz-box-shadow:inset 0px 1px 0px 0px #c1ed9c;\n	-webkit-box-shadow:inset 0px 1px 0px 0px #c1ed9c;\n	box-shadow:inset 0px 1px 0px 0px #c1ed9c;\n	background:-webkit-gradient( linear, left top, left bottom, color-stop(0.05, #9dce2c), color-stop(1, #8cb82b) );\n	background:-moz-linear-gradient( center top, #9dce2c 5%, #8cb82b 100% );\n	filter:progid:DXImageTransform.Microsoft.gradient(startColorstr=\'#9dce2c\', endColorstr=\'#8cb82b\');\n	background-color:#9dce2c;\n	-webkit-border-top-left-radius:20px;\n	-moz-border-radius-topleft:20px;\n	border-top-left-radius:20px;\n	-webkit-border-top-right-radius:20px;\n	-moz-border-radius-topright:20px;\n	border-top-right-radius:20px;\n	-webkit-border-bottom-right-radius:20px;\n	-moz-border-radius-bottomright:20px;\n	border-bottom-right-radius:20px;\n	-webkit-border-bottom-left-radius:20px;\n	-moz-border-radius-bottomleft:20px;\n	border-bottom-left-radius:20px;\n	text-indent:0;\n	border:1px solid #83c41a;\n	display:inline-block;\n	color:#ffffff;\n	font-family:Arial;\n	font-size:24px;\n	font-weight:bold;\n	fon