nUnderwriter','2014-04-23 06:56:35','2014-04-23 06:56:35',0,0,0,'/0/','43984',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Banner</Title></root>','banner','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div style=\"width:100%; background-color:#eee\">\n<div style=\"display: inline-block; width: 55%;\"><img alt=\"\" src=\"/documents/43801/0/Banner.png/ce4c1db1-e35e-4f2c-ba21-a65c60ca9db5?t=1398206870000\" style=\"height: 405px;\" /></div>\n\n<div id=\"yui_patched_v3_11_0_1_1390413114154_517\" style=\"display: inline-block; width: 44%;\">\n<div id=\"yui_patched_v3_11_0_1_1390413114154_516\" style=\"font-size: 32px; margin-bottom: 35px;\">Standing out as a broker is difficult,</div>\n\n<div style=\"font-size: 32px; text-align: right; margin-bottom: 67px;\">...but not impossible.</div>\n\n<div style=\"font-size: 32px;\">With Irish Broker PI, we proved it.</div>\n\n<div style=\"font-size: 18px; position: absolute; bottom: 40px;\">\n<p>Bluestone\'s Irish Broker PI is the leading professional indemnity product available in the market today especially designed for insurance brokers based in Ireland.</p>\n</div>\n</div>\n</div>]]></static-content>\n</root>','general','','','','2014-04-22 22:49:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2014-04-23 06:56:35'),('03da30f6-8cb0-44a1-bb5c-96ea317caed9',44441,43998,43801,10157,10436,'Adam OpenUnderwriter','2014-04-23 06:58:46','2014-04-23 06:58:46',0,0,0,'/0/','43996',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">News</Title></root>','news','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<table border=\"0\">\n	<tbody>\n		<tr>\n			<td valign=\"top\" width=\"50%\">\n			<table border=\"0\">\n				<tbody>\n					<tr>\n						<td valign=\"top\" width=\"128px\"><img alt=\"\" src=\"/documents/43801/0/clock.png/973f24ce-b296-46d8-ab67-16c6634aafbd?t=1398206870000\" style=\"height: 85px; width: 128px;\" /></td>\n						<td style=\"padding-left: 5px;\" valign=\"top\"><strong>Bluestone\'s Claim turn around times best in sector</strong>. A report by the OIF shows Bluestones claims handling to be the best in the PI sector, a full 25% more responsive than it\'s next leading competitor.</td>\n					</tr>\n					<tr>\n						<td colspan=\"2\">&nbsp;</td>\n					</tr>\n					<tr>\n						<td valign=\"top\"><img alt=\"\" src=\"/documents/43801/0/office+people.png/a99c1c4a-7544-489e-ae28-59b3dac20e4b?t=1398206870000\" style=\"height: 98px; width: 128px;\" /></td>\n						<td style=\"padding-left: 5px;\" valign=\"top\"><strong>Bluestone announces the opening of a new regional office.</strong> Bluestone has opened its third regional office. The new Dublin office opened last month joining Cork and Limerick to bring Irish Broker PI to more areas.</td>\n					</tr>\n				</tbody>\n			</table>\n\n			<p>&nbsp;</p>\n			</td>\n			<td valign=\"top\" width=\"50%\">\n			<table border=\"0\">\n				<tbody>\n					<tr>\n						<td valign=\"top \" width=\"128px\"><img alt=\"\" src=\"/documents/43801/0/hand+shake.png/e8534ef7-556a-4bbf-a3db-fe2be1584329?t=1398206868000\" style=\"height: 143px; width: 128px;\" /></td>\n						<td style=\"padding-left: 5px;\" valign=\"top\"><strong>Bluestone welcomes more new policy holders.</strong> Over the last year we are pleased to say that we have seen a 63% increase in new business take up over the previous year.</td>\n					</tr>\n					<tr>\n						<td colspan=\"2\">&nbsp;</td>\n					</tr>\n					<tr>\n						<td valign=\"top\"><img alt=\"\" src=\"/documents/43801/0/laptop.png/69d07b73-009e-48c8-8411-46d84d31e5c5?t=1398206870000\" style=\"height: 150px; width: 128px;\" /></td>\n						<td style=\"padding-left: 5px;\" valign=\"top\"><strong>Less paper work, and less red tape.</strong> Bluestone announced their online claims handling site today. This greatly simplifies the processing of claims and enables us to make payments faster than ever before.</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>]]></static-content>\n</root>','general','','','','2014-04-22 22:51:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2014-04-23 06:58:46'),('d09314e5-540b-43f0-b65a-39098b2e4520',44449,44024,43801,10157,10436,'Adam OpenUnderwriter','2014-04-23 07:07:01','2014-04-23 07:07:01',0,0,0,'/0/','44022',1.4,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Broker Login Tip</Title></root>','broker-login-tip','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<div style=\"background-color:#FFA;padding:4px\"><span style=\"color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19px; background-color: rgb(255, 255, 170);\">This site only allows registered brokers to perform quotations. To access this feature, login as the user</span>&nbsp;<strong>peter@openunderwriter.org</strong>&nbsp;using the password&nbsp;<strong>peter</strong>.</div>]]></static-content>\n</root>','general','','','','2014-04-22 22:53:00',NULL,NULL,1,0,0,'',0,10436,'Adam OpenUnderwriter','2014-04-23 07:07:01'),('d9867beb-d753-4898-8aa1-5e6232b4bfa1',44471,40817,22705,10157,10436,'Adam OpenUnderwriter','2014-04-23 07:16:00','2014-04-23 07:16:00',0,0,0,'/0/','40815',2.7,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Product Strip</Title></root>','product-strip','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<script src=\"/html/js/dynatree/jquery.js\"></script>\n<div style=\"border-bottom: 1px solid #1D8412; margin-bottom: 10px;\">\n	Try a sample product</div>\n<p>\n	OpenQuote comes with a number of pre-built sample products to give a feel for its capabilities. You can get try these right now by clicking the links below. The full product definitions and all of the supporting resources are also included and can be found in the Product Manager (see below).</p>\n<div id=\"produucts\" style=\"position:relative\">\n	<div class=\"ou-icon-strip\" id=\"product-strip\" style=\"max-width: 1450px;\">\n		<div style=\"width: 1450px;min-height:340px;\">\n			<div class=\"ou-icon-strip-section\">\n				<div class=\"ou-icon-strip-icon\" style=\"width:250px; height:290px;\">\n					<a href=\"/lifeplus\" style=\"display: block; width:250px; \">\n						<img alt=\"\" src=\"/documents/22705/0/LifePlusThumb.png/83f31829-2b57-4334-bb49-8a5db95fd688?t=1386092330000\" style=\"width: 226px; height: 169px;\" />\n						<p><b>LifePlus</b></p>\n						<p>A simple product based on Term Life. This is a good place to start learning the concepts of OpenQuote.</p>\n					</a>\n				</div>\n				<div class=\"ou-icon-strip-icon\" style=\"width:250px; height:290px;\">\n					<a href=\"/irishbrokerpi\" style=\"display: block; width:250px;\">\n						<img alt=\"\" src=\"/documents/22705/0/IrishBrokerPIThumb.png/61e44084-8b78-43b1-8e84-aac404ee8cda?t=1386092330000\" style=\"width: 226px; height: 177px;\" />\n						<p><b>Irish Broker PI</b></p>\n						<p>A product built in conjunction with City Net a London City broker. Most of the portal is open access, but to see the quotation tab you will need to login as <strong>broker</strong> (password also \'broker\').</p>\n					</a>\n				</div>\n				<div class=\"ou-icon-strip-icon\" style=\"width:250px; height:290px;\">\n					<a href=\"/motorplus\"  style=\"display: block; width:250px;\">\n						<img alt=\"\" src=\"/documents/22705/0/MotorPlusThumb.png/0183f87e-e7fe-4a32-a9e7-ed69148720c