INSERT INTO `Role_` VALUES ('cb7bbde7-23ed-4920-8533-e2a305381803',10164,10157,10161,'','2013-12-02 17:18:24','2013-12-02 17:18:24',10004,10164,'Administrator','','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Administrators are super users who can do anything.</Description></root>',1,''),('9a9ea7c9-b9e7-4404-b6ab-bdcc7838fc08',10165,10157,10161,'','2013-12-02 17:18:24','2013-12-02 17:18:24',10004,10165,'Guest','','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Unauthenticated users always have this role.</Description></root>',1,''),('619e757c-9a20-41ec-bc9f-a1f96c173a42',10166,10157,10161,'','2013-12-02 17:18:24','2013-12-02 17:18:24',10004,10166,'Owner','','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">This is an implied role with respect to the objects users create.</Description></root>',1,''),('0713e04b-6397-44a2-acc9-39c26267143e',10167,10157,10161,'','2013-12-02 17:18:24','2013-12-02 17:18:24',10004,10167,'Power User','','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Power Users have their own personal site.</Description></root>',1,''),('5ad502d7-916f-43ac-91c6-4a258c31d498',10168,10157,10161,'','2013-12-02 17:18:24','2013-12-02 17:18:24',10004,10168,'User','','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Authenticated users should be assigned this role.</Description></root>',1,''),('2ecab284-54f8-4589-8327-d925febc7375',10169,10157,10161,'','2013-12-02 17:18:25','2013-12-02 17:18:25',10004,10169,'Organization Administrator','','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=