INSERT INTO `WikiPage` VALUES ('0011ccca-d33a-4be7-8059-ca3b1b6bdd6b',37106,37107,10197,10157,10436,'Adam OpenUnderwriter','2014-02-18 07:38:38','2014-02-18 07:38:38',25363,'Product Development Tutorial',1,0,'','','html',0,'','',0,10436,'Adam OpenUnderwriter','2014-02-18 07:38:38'),('67c56b9a-7692-4e9f-9048-c7d3f0be2887',37138,37139,10197,10157,10436,'Adam OpenUnderwriter','2014-02-18 07:41:21','2014-02-18 07:41:21',25363,'First Steps With Talend',1,0,'','','html',0,'','',0,10436,'Adam OpenUnderwriter','2014-02-18 07:41:22'),('858d1a07-e983-4a44-8909-2c6482b1f966',37146,37147,10197,10157,10436,'Adam OpenUnderwriter','2014-02-18 07:41:46','2014-02-18 07:41:46',25363,'First Steps With Birt',1,0,'','','html',0,'','',0,10436,'Adam OpenUnderwriter','2014-02-18 07:41:46'),('73ef0197-09f4-43cf-9861-f8eaa72133ae',37482,37107,10197,10157,10436,'Adam OpenUnderwriter','2014-02-18 13:19:42','2014-02-18 13:19:42',25363,'Product Development Tutorial',1.1,0,'<h1>Introduction</h1>\n\n<p>This tutorial gives an overview of product development within OpenUnderwriter.</p>\n\n<p>This tutorial describes the process of making an update to an existing product definition. Using the FreightPlus demonstration product as a starting point, it adds a new question to the product\'s quotation screens and modifies the product\'s rating rules to take the answer to the new question into account during rating.</p>\n\n<p>The FreightPlus product is concerned with quoting for personal shipping insurance. While simple, it does represent a real world solution developed for one of OpenUnderwriter\'s clients. The additional question which will be added describes the type of commodity that is being shipped. The type will affect the premium. For example, the premium for refrigerated goods will be higher than that for dry goods. Four types of commodities are used: Dry, Refrigerated, Live and Other.</p>\n\n<h1>Requirements</h1>\n\n<ul>\n	<li>\n	<p>An running instance of OpenUnderwriter, version 2.0 or later, running on localhost.</p>\n	</li>\n	<li>\n	<p>A text editor. Notepad is fine on windows as is TextEdit (or&nbsp;vi, emacs) on a Mac.</p>\n	</li>\n	<li>\n	<p>A Excel compatible spreadsheet editor. Excel itself is fine, as are&nbsp;Libra office or OpenOffice.</p>\n	</li>\n</ul>\n\n<table border=\"0\" cellpadding=\"5\" cellspacing=\"1\" class=\"tip\">\n	<tbody>\n		<tr>\n			<td><span style=\"color: rgb(102, 102, 102);\">For simplicity this tutorial only requires using a text editor for updating most product resources. However, product development is normally carried out using some kind of IDE. Eclipse, NetBeans or InteliiJ are recommended. The features that these tools offer, like syntax highlighting, make it far easier to edit product resources.&nbsp;</span></td>\n		</tr>\n	</tbody>\n</table>\n\n<h1>The Product Development Sandpit</h1>\n\n<p>The sandpit screen is a feature of OpenUnderwriter that provides an environment where products can be executed and debugged. This tutorial will make extensive use of this feature. The sandpit can be opened using the following URL:</p>\n\n<p><code style=\"margin-left: 40px;\"><a href=\"/web/oq/sandpit\">http://localhost:8080/web/oq/sandpit</a></code></p>\n\n<p>Use the login: <code>katie@openunderwriter.org</code>, password: <code>katie</code>.</p>\n\n<table border=\"0\" cellpadding=\"5\" cellspacing=\"1\" class=\"tip\">\n	<tbody>\n		<tr>\n			<td><span style=\"color: rgb(102, 102, 102);\">Katie is one of a number of demonstration users who are created in a default installation. Katie is setup in the role of \"Product Developer\", and as such she has access to the sandpit. Other users, depending on their roles, may or may not have access.</span></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>Once logged in, the following sandpit screen will be displayed.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=Unknown.gif\" style=\"width: 1024px; height: 551px;\" /></p>\n\n<p>The main area of this screen is given over to displaying the product screens. No product is selected yet, so at this point it is blank. Above this is a panel that allows you to select products to work on&nbsp;and control various aspects of the process.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=control-2.gif\" style=\"width: 1024px; height: 46px;\" /></p>\n\n<h1>Freight Plus Product Walkthrough</h1>\n\n<p>Now select \"<code>AIL.Demo.FreightPlus</code>\" in the <strong>Product?</strong> drop down, and \"<code>QuotationPageFlow</code>\" in the <strong>PageFlow?</strong> drop down.&nbsp;</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=control-closeup.gif\" style=\"width: 600px; height: 87px;\" /></p>\n\n<p>After a short delay as the product is loaded,&nbsp;OpenUnderwriter will&nbsp;display the product\'s first page, the \"Welcome\" page. The product panel now shows exactly the same questions and options that a user would see when they visit the site for a FreightPlus quotation.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=questions.gif\" style=\"width: 1024px; height: 569px;\" /></p>\n\n<p>The FreightPlus product generates quotations for personal freight transportation insurance. With the product in it\'s default state only 4 questions need to be answered before a quotation or referral is presented. Over the course of the next sections in this tutorial an additional question will be added.</p>\n\n<p>For now, carry on with the quotation process by selecting the following options.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=questions.gif\" style=\"width: 1024px; height: 569px;\" /></p>\n\n<p>Now hit \"<strong>Quote</strong>\" and the quote will be rated. In this case the next screen displayed is the quotation screen, including the premium and some options for what to do next.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=quote.gif\" style=\"width: 1024px; height: 564px;\" /></p>\n\n<p>From there you can Save the quote so you can return to it later, or Requote which will take you back to the first page, but pre-fill it with the answers your originally gave. Hitting Quote Document will generate a quotation document, and Confirm and Pay will take you to further screens where you enter policy holder and payment information. Quit will restart the pageflow.</p>\n\n<p>Hit \"<strong>Quit</strong>\" to return to quit this quotation and restart the pageflow.</p>\n\n<p>If values are entered on the first screen for which a quote cannot be produced, a referral is generated. Entering the following values will have that effect.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=questons-refer.gif\" style=\"width: 1024px; height: 565px;\" /></p>\n\n<p>Hitting quote with these values will take you to the referral screen:</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=refer.gif\" style=\"width: 1024px; height: 568px;\" /></p>\n\n<p>In this case the only options are to Requote or Quit which have the same effect as they did on the quotation page.</p>\n\n<h1>Product Development Environment</h1>\n\n<p>All the aspects of the FreightPlus product that have been seen so far are configurable. And all are defined as part of a product definition. Product definitions are held within OpenUnderwriter\'s document library and can be accessed as files from your desktop.</p>\n\n<h2>MacOSX Setup</h2>\n\n<p>On a Mac, use Finder to connect to a server:</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=finder.gif\" style=\"width: 480px; height: 359px;\" /></p>\n\n<p>Enter <code>http://localhost:8080/webdav/global/document_library/Product/AIL/Demo/FreightPlus</code> as the server address, and click \"<strong>Connect</strong>\".</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=server.gif\" style=\"width: 480px; height: 335px;\" /></p>\n\n<p>Enter the username <code>katie@openunderwriter.org</code> with the password <code>katie</code>, and click connect.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=finder-login.gif\" style=\"width: 480px; height: 312px;\" /></p>\n\n<p>A new Finder window will open displaying the product definition.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=product-files.gif\" style=\"width: 512px; height: 286px;\" /></p>\n\n<h2>Windows Setup</h2>\n\n<p>[ADD DETAILS]</p>\n\n<h1>Adding the new question</h1>\n\n<p>To add a question to a product the product\'s pageflow is updated to define where the new question should appear and how it should be worded, and the product\'s model is updated to define how the answer is stored and any validations that should be applied to it.</p>\n\n<p>In the product definition, open the file <code>PageFlows/QuotationPageFlow.xml</code> in a text editor.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=pageflow-1.gif\" style=\"width: 820px; height: 347px;\" /></p>\n\n<p>This file contains defines the questions that will be asked. There are four at the moment (highlighted above). Add a new question by inserting the following text as shown in the screenshot below:</p>\n\n<p style=\"margin-left: 40px;\"><code>&lt;question title=\"What category of commodity are you shipping?\" binding=\"/asset/attribute[id=\'commodity\']\" /&gt;</code></p>\n\n<p>The following screenshot shows the modified file with the new line highlighted.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=pageflow-2.gif\" style=\"width: 840px; height: 354px;\" /></p>\n\n<p>Save the file.</p>\n\n<p>Now open the file <code>Model/Quotation.xml</code> in a text editor.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=quotation-1.gif\" style=\"width: 840px; height: 323px;\" /></p>\n\n<p>This file defines the structure of the quotation. This structure is modified to add a place to store the result from the new question, and to define the valid values for the answer. Add the following line as shown in the screenshot below:</p>\n\n<p style=\"margin-left: 40px;\"><code>&lt;attribute id=\"commodity\" value=\"?\" format=\"choice,options=-1#?|1#Dry|2#Refrigerated|3#Live|4#Other\" /&gt;</code></p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=quotation-2.gif\" style=\"width: 840px; height: 323px;\" /></p>\n\n<p>Save the file.</p>\n\n<h1>Testing the new question</h1>\n\n<p>The changes made in the previous section are immediately picked up. Return to the sandpit, and the new question is now displayed including appropriate values in for the answer.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=new-questions.gif\" style=\"width: 1024px; height: 603px;\" /></p>\n\n<table border=\"0\" cellpadding=\"5\" cellspacing=\"1\" class=\"tip\">\n	<tbody>\n		<tr>\n			<td>If you had quit your browser session, login and open the FreightPlus product in the sandpit as before. Otherwise, hit the green restart button (<img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=17.png\" style=\"width: 22px; height: 22px; box-shadow: none; margin: 0px;\" />) on the sandpit or refresh the browser to pick up the new question.</td>\n		</tr>\n	</tbody>\n</table>\n\n<h1>Rating changes</h1>\n\n<p>With the question added and the model updated to hold the answer, the next step is to take this new information into account during rating. The following changes will be made:</p>\n\n<p>&nbsp;&nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;A commodity type of Refrigerated will attract a 10% loading, Live will attract a 15% loading. Other will cause a referral. Selecting Dry will leave the behaviour unchanged.</p>\n\n<p>The rating rules for FreightPlus are defined in the form of a spreadsheet. Changing the rules to take into account the new information simply involves editing that spreadsheet. From the product definition folder, open the file Rules/PolicyRating.xls in Excel, Libra Office or a similar tool.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-1.gif\" style=\"width: 1024px; height: 855px;\" /></p>\n\n<p>The spreadsheet is broken into tables. In this case there are two, one (very long) table detailing rating by destination and mode of transport, and another further down which handles the answer to the \"Would you like cover for shipping delay?\" question.</p>\n\n<p>Each table is layer out with conditions on the left, and actions on the right. At the top of the first table are the rules covering UK destinations, then European Union etc. The first few rows say, in effect:</p>\n\n<p>&nbsp;&nbsp; &nbsp;If the destination is UK and the mode of transport is Road, then apply a premium rate of 0.5%.<br />\n&nbsp;&nbsp; &nbsp;If the destination is UK and the mode of transport is Rail, then apply a premium rate to 0.4%.<br />\n&nbsp;&nbsp; &nbsp;If the destination is UK and the mode of transport is Sea, then refer the quotation.<br />\n&nbsp;&nbsp; &nbsp;If the destination is UK and the mode of transport is Air, then refer the quotation.</p>\n\n<p>A new table will be added at the end of the spreadsheet to include the new rules for commodity.&nbsp;</p>\n\n<p>To make the spreadsheet more readable, especially when it may be shared with non-technical users, the control rows which allow OpenUnderwriter to interpret the spreadsheet\'s content are normally hidden. Click the + sign next to the destinations rating table to reveal the control rows.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=unhide-1.gif\" style=\"width: 559px; height: 116px;\" /></p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=unhide-2.gif\" style=\"width: 1024px; height: 855px;\" /></p>\n\n<p>Take a copy of first 9 rows (rows 40-48)&nbsp;of the table.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-selection.gif\" style=\"width: 1024px; height: 250px;\" /></p>\n\n<p>Paste a copy of these rows at the end of the spreadsheet.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-paste.gif\" style=\"width: 1024px; height: 855px;\" /></p>\n\n<p>For the purposes of this rating change only one condition column is needed, so delete the 1st column of cells in the new table taking care not to delete anything from the 1st row.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-delete.gif\" style=\"width: 1024px; height: 288px;\" />&nbsp;</p>\n\n<p><br />\n<img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-deleted.gif\" style=\"width: 1021px; height: 290px;\" /></p>\n\n<p>The basic structure of the table is now in place, but the cells need to be edited to match the new rating conditions. Ignoring the control cells (in blue) update the other cells to the values&nbsp;shown below.&nbsp;</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-edited.gif\" style=\"width: 1024px; height: 284px;\" /></p>\n\n<table border=\"0\" cellpadding=\"5\" cellspacing=\"1\" class=\"tip\">\n	<tbody>\n		<tr>\n			<td>The \"Dry\" row is not really necessary as it has no actions associated with it, but including all of the possible values helps readability.</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>The last step is to update control information. The control information provides an enormous amount of flexibility and power, but for now simply paste the following values into the cells shown:</p>\n\n<p>&nbsp;<strong>B200</strong>&nbsp;&nbsp; &nbsp;<code>name==\"commodity\", stringValue==\"$1\"</code>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\n&nbsp;<strong>C200</strong>&nbsp;&nbsp; &nbsp;<code>$AssessmentSheetArgRet.addLoading(\"$2\", \"total premium\", \"total premium\", new Rate(\"$1\"));</code><br />\n&nbsp;<strong>D200</strong>&nbsp;&nbsp; &nbsp;<code>$AssessmentSheetArgRet.addReferral(\"$param:\");</code></p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-edited-2.gif\" style=\"width: 1024px; height: 295px;\" /></p>\n\n<table border=\"0\" cellpadding=\"5\" cellspacing=\"1\" class=\"tip\">\n	<tbody>\n		<tr>\n			<td>The styles used in the spreadsheet aren\'t important to OpenUnderwriter, but they do make a huge difference to readability. Deleting the formatting in cell E197, and hiding rows 197 to 200 makes the purpose of the rules clearer. In a commercial setting it is quite common to need a non-technical user to sign-off on changes. This is made easier without the distraction of technical information.</td>\n		</tr>\n	</tbody>\n</table>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-edited-3.gif\" style=\"width: 1024px; height: 374px;\" /></p>\n\n<p>The spreadsheet changes are now complete. Saving it will make the new rules instantly active.</p>\n\n<h1>Testing the new rating</h1>\n\n<p>Return to the sandpit and start a new FreightPlus quotation. The session will probably have time-out by now so it will be necessary to login again and return to the sandpit.</p>\n\n<p>Enter the values below and hit the <strong>Quote</strong> button.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=updated-sandpit.gif\" style=\"width: 1024px; height: 595px;\" /></p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=new-quotation.gif\" style=\"width: 1024px; height: 563px;\" /></p>\n\n<p>The premium is now showing as 110. This suggests that a 10% loading has been added for the Refrigerated commodity option as would be hoped. However, that can be confirmed by switching the sandpit into its \"Assessment Sheet\" view.</p>\n\n<p>In the sandpit\'s control panel, switch the <strong>View</strong> from <strong>Wizard</strong> to <strong>Assessment sheet</strong>.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=assessment-sheet.gif\" style=\"width: 1024px; height: 899px;\" /></p>\n\n<p>The assessment sheet records how OpenUnderwriter arrived at the premium of 110, or in the case of a referral or a decline it would detail how the system arrived at that conclusion. This information is stored with the quote itself so it forms part of the historical record.</p>\n\n<p>In this case the assessment sheet shows that a \"base premium\" of 10 was initially arrived at. The new commodity rule then added a loading to the premium of 10%. It would seem that this should have lead to a total premium of 11, but the total premium is actually shown as 110. What\'s going on?</p>\n\n<p>Looking further down the assessment sheet, there is a note. FreightPlus defines a minimum premium rule which will automatically adjust the base premium up to 100 if it falls below that value. That rule has fired and adjusted the premium. It also inserted this note to explain the apparently strange result.</p>\n\n<p>The note refers to the \"\'31\' control line\". This is a reference to the row in the rating spreadsheet that defines the rule. As it is considered to be a control line the row is normally hidden, but returning to the spreadsheet and unhiding that section revels the following.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-control.gif\" style=\"width: 1024px; height: 855px;\" /></p>\n\n<h1>Thank you</h1>\n\n<p>Thank you for using this tutorial, we hope it was helpful to you. Please consider commenting on our forum or giving us a thumbs up on facebook, linkedin or twitter if you have found this tutorial and OpenUnderwriter useful.</p>','','html',0,'','',0,10436,'Adam OpenUnderwriter','2014-02-18 13:19:42'),('3a57027a-d04c-4af0-8ab3-80f4d6bbb9bd',37614,37615,10197,10157,10436,'Adam OpenUnderwriter','2014-02-18 17:20:59','2014-02-18 17:20:59',25363,'ETL Scenarios',1,0,'<h1>Introduction</h1>\n\n<p>This page describes how data could be loaded into OpenActuary\'s staging database using Motor as an example.</p>\n\n<p>These scenarios start from the assumption that some kind of operational data store contains policy information that is being continuously updated. Periodically, a job is run which identifies records in that data store that have been added or updated since the last time the job was run. That job then needs to upload that data into OpenActuary.</p>\n\n<p>Keep in mind that at all times that the OpenActuary system is a policy logging system - it records policy events and all the data associated with policy when the event happened. It is not a policy administration system. So, it doesn\'t need to avoid storing the same information twice, in fact for ease of use it is often better that it does store duplicates, and records are never updated once they have been inserted.</p>\n\n<h2>Scenario 1: Uploading a policy as new business</h2>\n\n<p>This is the simplest scenario, because we don\'t have to worry about any older records in OpenActuary which relate to the same policy. However, we do still need to make sure that the FKs are correct. We will assume that the insurance company knows this policy as <strong>84848 </strong>(that is the PR_POL_SYS_ID in some systems).</p>\n\n<p>First you insert the polPolicy record:</p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\n	<tbody>\n		<tr>\n			<td style=\"background-color: rgb(255, 255, 204);\"><code>insert into polPolicy (<br />\n			&nbsp; &nbsp; polCoverTypeIDcov,<br />\n			&nbsp; &nbsp;&nbsp;polInsuredTypeIDins,<br />\n			&nbsp; &nbsp;&nbsp;polReasonIDrea,<br />\n			&nbsp; &nbsp; polExternalSystemId<br />\n			&nbsp; &nbsp; <em>-- (other column names here as necessary)</em><br />\n			)<br />\n			values (<br />\n			&nbsp; &nbsp; \'COMPREHENSIVE\',<br />\n			&nbsp; &nbsp; \'PERSONAL\',<br />\n			&nbsp; &nbsp; \'NEW BUSINESS\',<br />\n			&nbsp; &nbsp; \'<strong>84848</strong>\'<br />\n			&nbsp; &nbsp; <em>-- (other values here as necessary)</em><br />\n			);</code></td>\n		</tr>\n	</tbody>\n</table>\n\n<table cellpadding=\"0\" cellspacing=\"0\" class=\"tip\">\n	<tbody>\n		<tr>\n			<td><span style=\"color: rgb(102, 102, 102);\">Notice that we didn\'t populate polID. polID is a UUID, as are all of the IDs in the major tables, which is automatically populated by a trigger when a record is inserted. It is important that this is a UUID because this record will at some point be merged into the master database. As a UUID we can be sure that no other record in the master will be using this ID.</span></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>Now you need to add a vehicle to the policy:</p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\n	<tbody>\n		<tr>\n			<td style=\"background-color: rgb(255, 255, 204);\"><code>insert into vehVehicle (<br />\n			&nbsp; &nbsp; vehPolicyIDpol,<br />\n			&nbsp; &nbsp; vehBodyIDbod,<br />\n			&nbsp; &nbsp; vehParkedIDpar,<br />\n			&nbsp; &nbsp; vehSumInsuredLocalAmount,<br />\n			&nbsp; &nbsp; vehSumInsuredLocalIDccy<br />\n			&nbsp; &nbsp; <em>-- (other columns here as necessary)</em><br />\n			)<br />\n			values (<br />\n			&nbsp; &nbsp; (select polID from polPolicy where polExternalSystemID=\'<strong>84848</strong>\' and polReplaced is null),<br />\n			&nbsp; &nbsp; \'CONVERTIBLE\',<br />\n			&nbsp; &nbsp; \'GARAGE\',<br />\n			&nbsp; &nbsp; 15000,<br />\n			&nbsp; &nbsp; \'GHS\'<br />\n			&nbsp; &nbsp; <em>-- (other values here as necessary)</em><br />\n			);</code></td>\n		</tr>\n	</tbody>\n</table>\n\n<table cellpadding=\"0\" cellspacing=\"0\" class=\"tip\">\n	<tbody>\n		<tr>\n			<td>\n			<p><span style=\"line-height: 1.4;\">You might notice a few things here:</span></p>\n\n			<p>1) See how vehPolicyIDpol is populated. This sub-select allows us to avoid having to ever refer to polID directly, we\'re only using polExternalSystemID - which is the insurance company\'s&nbsp;ID for the policy</p>\n\n			<p>2) The polReplaced=null criteria - in truth this is superfluous for a new business record. It\'s purpose will become clear in the other scenarios, it is used here just to keep the queries consistent.&nbsp;</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>Other tables would be filled in using a similar approach.&nbsp;</p>\n\n<h2>Scenario 2: Uploading a policy as a renewal</h2>\n\n<p>In this scenario there already is one (or many more) other records in polPolicy which relate to the policy being uploaded. We will continue use the same insurance company policy in this example, so the existing record in polPolicy will have an polExternalSystemID of 84848.</p>\n\n<p><span style=\"line-height: 1.4;\">The first step is to mark any other records for this policy as \"replaced\":</span></p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\n	<tbody>\n		<tr>\n			<td style=\"background-color: rgb(255, 255, 204);\"><code>update polPolicy set polReplaced=NOW() where polReplaced is null and polExternalSystemID=\'<strong>84848</strong>\';</code></td>\n		</tr>\n	</tbody>\n</table>\n\n<p><span style=\"line-height: 1.4;\">The fact that polReplaced is not null is taken to mean that that policy records has been replaced.</span></p>\n\n<p><span style=\"line-height: 1.4;\">From now on, the process is extremely to scenario 1. The only difference being the reason column as you would expect:</span></p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\n	<tbody>\n		<tr>\n			<td style=\"background-color: rgb(255, 255, 204);\"><code>insert into polPolicy (<br />\n			&nbsp; &nbsp; polCoverTypeIDcov,<br />\n			&nbsp; &nbsp; polInsuredTypeIDins,<br />\n			&nbsp; &nbsp; polReasonIDrea,<br />\n			&nbsp; &nbsp; polExternalSystemId<br />\n			&nbsp; &nbsp; -- (other column names here as necessary)<br />\n			)<br />\n			values (<br />\n			&nbsp; &nbsp; \'COMPREHENSIVE\',<br />\n			&nbsp; &nbsp; \'PERSONAL\',<br />\n			&nbsp; &nbsp; \'RENEWAL\',<br />\n			&nbsp; &nbsp; \'<strong>84848</strong>\'<br />\n			&nbsp; &nbsp; <em>-- (other values here as necessary)</em><br />\n			);</code></td>\n		</tr>\n	</tbody>\n</table>\n\n<p><span style=\"line-height: 1.4;\">Now you need to add a vehicle to the policy. Notice that we are inserting an almost identical record. This is intentional :</span></p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\n	<tbody>\n		<tr>\n			<td style=\"background-color: rgb(255, 255, 204);\"><code>insert into vehVehicle (<br />\n			&nbsp; &nbsp; vehPolicyIDpol,<br />\n			&nbsp; &nbsp; vehBodyIDbod,<br />\n			&nbsp; &nbsp; vehParkedIDpar,<br />\n			&nbsp; &nbsp; vehSumInsuredLocalAmount,<br />\n			&nbsp; &nbsp; vehSumInsuredLocalIDccy<br />\n			&nbsp; &nbsp; -- (other <em>columns here as necessary)</em><br />\n			)<br />\n			values (<br />\n			&nbsp; &nbsp; (select polID from polPolicy where polExternalSystemID=\'<strong>84848</strong>\' and polReplaced is null),<br />\n			&nbsp; &nbsp; \'CONVERTIBLE\',<br />\n			&nbsp; &nbsp; \'GARAGE\',<br />\n			&nbsp; &nbsp; 15000,<br />\n			&nbsp; &nbsp; \'GHS\'<br />\n			&nbsp; &nbsp; <em>-- (other values here as necessary)</em><br />\n			);</code></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>Now it is clear why the <strong>polReplaced is null</strong> criteria is important. This is the means by which we can be sure that we are linking this vehVehicle to the most recent version of the policy in polPolicy - because only the most recent version will have a null in polReplaced.</p>\n\n<p><span style=\"font-size: 1.6em; font-weight: bold; color: rgb(0, 0, 0); line-height: 1.4;\">Scenario 3: Uploading a policy when a claim is made</span></p>\n\n<p><span style=\"line-height: 1.4;\">Recording a claim, at first sight might appear to present some problems. A claim may relate to the current policy (i.e. the latest one in ARDR that has a null in polReplaced) or it might relate to an old policy that has already been replaced - which might mean that we\'re writing an older record into the database than ARDR already has? Sounds wrong? But remember, ARDR is a log of policy events not a policy administration system. Events are record in the order that they occurs, without respect to the date of the records they relate to.</span></p>\n\n<p><span style=\"line-height: 1.4;\">Just like in scenario 2, we start by making sure that any old polPolicy records for this policy are marked as replaced:</span></p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\n	<tbody>\n		<tr>\n			<td style=\"background-color: rgb(255, 255, 204);\"><code>update polPolicy set polReplaced=NOW() where polReplaced is null and polExternalSystemID=\'<strong>84848\'</strong>;</code></td>\n		</tr>\n	</tbody>\n</table>\n\n<p><span style=\"line-height: 1.4;\">Uploading the policy information is very similar to the previous scenarios:</span></p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\n	<tbody>\n		<tr>\n			<td style=\"background-color: rgb(255, 255, 204);\"><code>insert into polPolicy (<br />\n			&nbsp; &nbsp; polCoverTypeIDcov,<br />\n			&nbsp; &nbsp; polInsuredTypeIDins,<br />\n			&nbsp; &nbsp; polReasonIDrea,<br />\n			&nbsp; &nbsp; polExternalSystemId<br />\n			&nbsp; &nbsp; <em>-- (other column names here as necessary)</em><br />\n			)<br />\n			values (<br />\n			&nbsp; &nbsp; \'COMPREHENSIVE\',<br />\n			&nbsp; &nbsp; \'PERSONAL\',<br />\n			&nbsp; &nbsp; \'CLAIM\',<br />\n			&nbsp; &nbsp; \'<strong>84848</strong>\'<br />\n			&nbsp; &nbsp; <em>-- (other values here as necessary)</em><br />\n			);</code></td>\n		</tr>\n	</tbody>\n</table>\n\n<p><span style=\"line-height: 1.4;\">You then insert the vehicle involved in the claim, we\'ll insert the others later:</span></p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\n	<tbody>\n		<tr>\n			<td style=\"background-color: rgb(255, 255, 204);\"><code>insert into vehVehicle (<br />\n			&nbsp; &nbsp; vehPolicyIDpol,<br />\n			&nbsp; &nbsp; vehBodyIDbod,<br />\n			&nbsp; &nbsp; vehParkedIDpar,<br />\n			&nbsp; &nbsp; vehSumInsuredLocalAmount,<br />\n			&nbsp; &nbsp; vehSumInsuredLocalIDccy<br />\n			&nbsp; &nbsp; <em>-- (other columns here as necessary)</em><br />\n			)<br />\n			values (<br />\n			&nbsp; &nbsp; (select polID from polPolicy where polExternalSystemID=\'<strong>84848\' </strong>and polReplaced is null),<br />\n			&nbsp; &nbsp; \'CONVERTIBLE\',<br />\n			&nbsp; &nbsp; \'GARAGE\',<br />\n			&nbsp; &nbsp; 15000,<br />\n			&nbsp; &nbsp; \'GHS\'<br />\n			&nbsp; &nbsp; <em>-- (other values here as necessary)</em><br />\n			);</code></td>\n		</tr>\n	</tbody>\n</table>\n\n<p><span style=\"line-height: 1.4;\">Then insert the claim itself:</span></p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\n	<tbody>\n		<tr>\n			<td style=\"background-color: rgb(255, 255, 204);\"><code>insert into clmClaim (<br />\n			&nbsp; &nbsp; clmPolicyIDpol,<br />\n			&nbsp; &nbsp; clmVehicleIDveh,<br />\n			&nbsp; &nbsp; clmClaimTypeIDcla,<br />\n			&nbsp; &nbsp; clmAmountPaidAmount,<br />\n			&nbsp; &nbsp; clmAmountPaidIDccy<br />\n			&nbsp; &nbsp; <em>-- (other column names here as necessary)</em><br />\n			)<br />\n			values (<br />\n			&nbsp; &nbsp; (select polID from polPolicy where polExternalSystemID=\'<strong>84848</strong>\' and polReplaced is null),<br />\n			&nbsp; &nbsp; (select vehID from vehVehicle join polPolicy on vehPolicyIDpol=polID where polExternalSystemID=\'<strong>84848</strong>\' and polReplaced is null),<br />\n			&nbsp; &nbsp; \'DAMAGE TO VEHICLE BY FIRE\',<br />\n			&nbsp; &nbsp; 2500,<br />\n			&nbsp; &nbsp; \'GHS\'<br />\n			&nbsp; &nbsp;<em>-- (other values here as necessary)</em><br />\n			);</code></td>\n		</tr>\n	</tbody>\n</table>\n\n<p><span style=\"line-height: 1.4;\">For a claim\'s details to be complete, as well as the clmClaim record you should also create either a accAccident record or a theTheftFire record to hold the specific details. We\'ll use a theTheftFire as the example here.</span></p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\n	<tbody>\n		<tr>\n			<td style=\"background-color: rgb(255, 255, 204);\"><code>insert into theTheftFire (<br />\n			&nbsp; &nbsp;theClaimIDclm,<br />\n			&nbsp; &nbsp;theAlarmOn,<br />\n			&nbsp; &nbsp;theAnyToolsInVehicle<br />\n			&nbsp; &nbsp;<em>-- (other column names here as necessary)</em><br />\n			)<br />\n			values (<br />\n			&nbsp; &nbsp; (select clmID from clmClaim join polPolicy on clmPolicyIDpol=polID where polExternalSystemID=\'<strong>84848</strong>\' and polReplaced is null),<br />\n			&nbsp; &nbsp; true,<br />\n			&nbsp; &nbsp; false<br />\n			&nbsp; &nbsp; <em>-- (other values here as necessary)</em><br />\n			);</code></td>\n		</tr>\n	</tbody>\n</table>\n\n<p><span style=\"line-height: 1.4;\">You can now add any other vehicle records. We had to split the creation of the vehicle records into two parts (one earlier in the scenario and one now). The first insert, above, inserted the details of the vehicle that was involved in the claim. Doing that vehicle alone meant that we could easily link the claim to it without fear of picking up the wrong vehicle. It is safe now though to add any other vehicles. The insert statement is exactly as before, just with other details to match the vehicle.</span></p>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\n	<tbody>\n		<tr>\n			<td style=\"background-color: rgb(255, 255, 204);\"><code>insert into vehVehicle (<br />\n			&nbsp; &nbsp; vehPolicyIDpol,<br />\n			&nbsp; &nbsp; vehBodyIDbod,<br />\n			&nbsp; &nbsp; vehParkedIDpar,<br />\n			&nbsp; &nbsp; vehSumInsuredLocalAmount,<br />\n			&nbsp; &nbsp; vehSumInsuredLocalIDccy<br />\n			&nbsp; &nbsp; <em>-- (other columns here as necessary)</em><br />\n			)<br />\n			values (<br />\n			&nbsp; &nbsp; (select polID from polPolicy where polExternalSystemID=\'<strong>84848</strong>\' and polReplaced is null),<br />\n			&nbsp; &nbsp; \'4X4\',<br />\n			&nbsp; &nbsp; \'ON ROAD\',<br />\n			&nbsp; &nbsp; 50000,<br />\n			&nbsp; &nbsp; \'GHS\'<br />\n			&nbsp; &nbsp; <em>-- (other values here as necessary)</em><br />\n			);</code></td>\n		</tr>\n	</tbody>\n</table>','','html',1,'','',0,10436,'Adam OpenUnderwriter','2014-02-18 17:21:00'),('3f2c5464-2cb7-4c7a-a1ff-92d13cc582d9',37759,37147,10197,10157,10436,'Adam OpenUnderwriter','2014-02-18 17:29:58','2014-02-18 17:29:58',25363,'First Steps With Birt',1.1,0,'<h1>Introduction</h1>\n\n<p>Birt in an open source reporting tool including a WYSIWYG report authoring tool and server side reporting engine. OpenActuary &nbsp;includes the server side engine in its default configuration. Report authors run a client application to create report templates which can then be uploaded into <span style=\"color: rgb(102, 102, 102);\">OpenActuary</span> where other users can view the reports generated from them.</p>\n\n<p>This tutorial takes you through the process of installing Birt, and creating a simple project with access to am <span style=\"color: rgb(102, 102, 102);\">OpenActuary</span> data source. The data in this data source could then be used to author reports.</p>\n\n<h2>Installation</h2>\n\n<p>The latest release of Birt is available for download <a href=\"http://www.eclipse.org/downloads/packages/node/1080\">here</a>.</p>\n\n<p>Birt runs within the Eclipse application framework, and those familiar with Eclipse might prefer to install Birt as a plugin into their exiting Eclipse installation. Apart from the initial download and installation steps, this tutorial is equally applicable to both types of environment.</p>\n\n<p>Once you have downloaded Birt, unpack it into a convenient folder on your machine. You can then start the tool by running the Eclipse.exe (or Eclipse.app on MacOs) which you\'ll find in the installation folder.</p>\n\n<p>In common with normal Eclipse practice, projects are organised into a workspace. You will be prompted to select a workspace, or create a new one as soon as the application starts</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+1.jpg\" style=\"width: 473px; height: 195px; \" /></p>\n\n<p>Accept the default workspace, and just click \"OK\". Birt will open and display a welcome screen.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+2.jpg\" style=\"width: 819px; height: 614px; \" /></p>\n\n<p>Click the arrow icon on the right to open the workbench</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+3.jpg\" style=\"width: 819px; height: 614px; \" /></p>\n\n<p>If you\'ve used Eclipse before you\'ll be familiar with the layout of the screen. If not, the left hand pane displays a navigator view of project elements (blank now because we haven\'t created a project yet). The middle pane will display the report design, the bottom one dill display various properties. The pane on the right displays an outline tree view of whatever you\'re editing.</p>\n\n<h2>Creating a Project</h2>\n\n<p>In the application menu, drill down File-&gt;New-&gt;Other. This will open a dialog box containing a list of options including \"Business Intelligence and Reporting Tools\". open this and select \"Report Project\" then click \"Next &gt;\".</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+4.jpg\" style=\"width: 488px; height: 450px; \" /></p>\n\n<p>Give the project the name \"<span style=\"color: rgb(102, 102, 102);\">OpenActuary</span> Test\", and click \"Finish\", the click \"Yes\" on the dialog box.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+5.jpg\" style=\"width: 478px; height: 454px; \" /></p>\n\n<p>You are now in the report designer proper, but we don\'t get have a report to work with.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+6.jpg\" style=\"width: 819px; height: 614px; \" /></p>\n\n<h2>Creating a Report</h2>\n\n<p>To create a report navigate to File-&gt;New-&gt;Report. This will open the new report wizard. Select \"OpenActuary Test\" if it isn\'t selected already, and change the file name to \"TestReport.rptdesign\", then click \"Finish\".</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+7.jpg\" style=\"width: 484px; height: 522px; \" /></p>\n\n<p>Now you\'ll be presented with the actual report authoring tool. The WYSIWYG report designer is in the middle of the screen, with a palette of report widgets on the left and a detail property view at the bottom of the window.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+8.jpg\" style=\"width: 819px; height: 614px; \" /></p>\n\n<h2>Adding a Data Source</h2>\n\n<p>The report will need a data source in order to populate it with some real data. To create a data source for the report, select the \"Data\" tab, which is right next to the \"Palette\" in the top left area of the window.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+9.jpg\" style=\"width: 250px; height: 82px; \" /></p>\n\n<p>From there, right click \"Data Source\", and select \"New Data Source\" from the context menu. You can see from the following wizard that Birt can connect to all kinds of data sources, but in this case we want to connect to a \"JDBC Data Source\". So, select this and enter the name \"OpenActuary Data Source\", and click \"Next &gt;\".</p>\n\n<p>The wizard\'s next screen lets you enter the database connection details.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+10.jpg\" style=\"width: 583px; height: 404px; \" /></p>\n\n<p>You can find out what values to enter by visiting the \"Sources\" tab in <span style=\"color: rgb(102, 102, 102);\">OpenActuary</span>. For our purposes, we\'ll use <span style=\"color: rgb(102, 102, 102);\">OpenActuary\'s</span> demo user \"Lily\". Lily works for Met and has writ access to Met\'s staging database. From <span style=\"color: rgb(102, 102, 102);\">OpenActuary\'s</span> interface, we can get the connection details.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+11.jpg\" style=\"width: 819px; height: 731px; \" /></p>\n\n<p>And enter them into the wizard.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+12.jpg\" style=\"width: 586px; height: 412px; \" /></p>\n\n<p>Once you\'ve entered the connection details, click \"Test Connection...\" to make sure the settings are correct. You should get a \"Connection successful\" response. If you don\'t, the check the details and make sure that you have MySQL running.</p>\n\n<p>Assuming the connection is working, click \"Finish\".</p>\n\n<h2>Adding a Data Set</h2>\n\n<p>To include data form a data source in a report, a data set is needed. This defines the query to run on the database to extract the information for the report.</p>\n\n<p>Back in the Data tab, right click on Data Set, and select \"New Data Set\" form the context menu.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+13.jpg\" style=\"width: 819px; height: 559px; \" /></p>\n\n<p>Make sure the \"OpenActuary Data Source\" is selected under JDBC Data Source, and enter polPolicy as a \"Data Set Name\", then click \"Next &gt;\".</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+14.jpg\" style=\"width: 658px; height: 510px; \" /></p>\n\n<p>Now we can define the query. Fill in the Query text field as shown below, and click Finished.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+15.jpg\" style=\"width: 660px; height: 493px; \" /></p>\n\n<p>A dialog box with then open showing you the columns that result from the query. You can make changes here if necessary, but in this case we just want accept them all. So click \"OK\" without changing anything.</p>\n\n<p>Now that you have the database defined, and the data set defined, all you need to do is design the report to use them.</p>','','html',0,'','',0,10436,'Adam OpenUnderwriter','2014-02-18 17:29:58'),('4c44572f-eef2-4562-88bd-a83dd624bc26',37763,37147,10197,10157,10436,'Adam OpenUnderwriter','2014-02-18 17:32:09','2014-02-18 17:32:09',25363,'First Steps With Birt',1.2,0,'<h1>Introduction</h1>\n\n<p>Birt in an open source reporting solution including a WYSIWYG report authoring tool and server side reporting engine. OpenActuary includes the server side engine in its default configuration. Report authors run a client application to create report templates which can then be uploaded into <span style=\"color: rgb(102, 102, 102);\">OpenActuary</span> where other users can view the reports generated from them.</p>\n\n<p>This tutorial takes you through the process of installing Birt, and creating a simple project with access to am <span style=\"color: rgb(102, 102, 102);\">OpenActuary</span> data source. The data in this data source could then be used to author reports.</p>\n\n<h2>Installation</h2>\n\n<p>The latest release of Birt is available for download <a href=\"http://www.eclipse.org/downloads/packages/node/1080\">here</a>.</p>\n\n<p>Birt runs within the Eclipse application framework, and those familiar with Eclipse might prefer to install Birt as a plugin into their exiting Eclipse installation. Apart from the initial download and installation steps, this tutorial is equally applicable to both types of environment.</p>\n\n<p>Once you have downloaded Birt, unpack it into a convenient folder on your machine. You can then start the tool by running the Eclipse.exe (or Eclipse.app on MacOS) which you\'ll find in the installation folder.</p>\n\n<p>In common with normal Eclipse practice, projects are organised into a workspace. You will be prompted to select a workspace, or create a new one as soon as the application starts</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+1.jpg\" style=\"width: 473px; height: 195px; \" /></p>\n\n<p>Accept the default workspace, and just click \"OK\". Birt will open and display a welcome screen.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+2.jpg\" style=\"width: 819px; height: 614px; \" /></p>\n\n<p>Click the arrow icon on the right to open the workbench</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+3.jpg\" style=\"width: 819px; height: 614px; \" /></p>\n\n<p>If you\'ve used Eclipse before you\'ll be familiar with the layout of the screen. If not, the left hand pane displays a navigator view of project elements (blank now because we haven\'t created a project yet). The middle pane will display the report design, the bottom one dill display various properties. The pane on the right displays an outline tree view of whatever you\'re editing.</p>\n\n<h2>Creating a Project</h2>\n\n<p>In the application menu, drill down File-&gt;New-&gt;Other. This will open a dialog box containing a list of options including \"Business Intelligence and Reporting Tools\". open this and select \"Report Project\" then click \"Next &gt;\".</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+4.jpg\" style=\"width: 488px; height: 450px; \" /></p>\n\n<p>Give the project the name \"<span style=\"color: rgb(102, 102, 102);\">OpenActuary</span> Test\", and click \"Finish\", the click \"Yes\" on the dialog box.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+5.jpg\" style=\"width: 478px; height: 454px; \" /></p>\n\n<p>You are now in the report designer proper, but we don\'t get have a report to work with.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+6.jpg\" style=\"width: 819px; height: 614px; \" /></p>\n\n<h2>Creating a Report</h2>\n\n<p>To create a report navigate to File-&gt;New-&gt;Report. This will open the new report wizard. Select \"OpenActuary Test\" if it isn\'t selected already, and change the file name to \"TestReport.rptdesign\", then click \"Finish\".</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+7.jpg\" style=\"width: 484px; height: 522px; \" /></p>\n\n<p>Now you\'ll be presented with the actual report authoring tool. The WYSIWYG report designer is in the middle of the screen, with a palette of report widgets on the left and a detail property view at the bottom of the window.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+8.jpg\" style=\"width: 819px; height: 614px; \" /></p>\n\n<h2>Adding a Data Source</h2>\n\n<p>The report will need a data source in order to populate it with some real data. To create a data source for the report, select the \"Data\" tab, which is right next to the \"Palette\" in the top left area of the window.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+9.jpg\" style=\"width: 250px; height: 82px; \" /></p>\n\n<p>From there, right click \"Data Source\", and select \"New Data Source\" from the context menu. You can see from the following wizard that Birt can connect to all kinds of data sources, but in this case we want to connect to a \"JDBC Data Source\". So, select this and enter the name \"OpenActuary Data Source\", and click \"Next &gt;\".</p>\n\n<p>The wizard\'s next screen lets you enter the database connection details.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+10.jpg\" style=\"width: 583px; height: 404px; \" /></p>\n\n<p>You can find out what values to enter by visiting the \"Sources\" tab in <span style=\"color: rgb(102, 102, 102);\">OpenActuary</span>. For our purposes, we\'ll use <span style=\"color: rgb(102, 102, 102);\">OpenActuary\'s</span> demo user \"Lily\". Lily works for Met and has writ access to Met\'s staging database. From <span style=\"color: rgb(102, 102, 102);\">OpenActuary\'s</span> interface, we can get the connection details.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+11.jpg\" style=\"width: 819px; height: 731px; \" /></p>\n\n<p>And enter them into the wizard.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+12.jpg\" style=\"width: 586px; height: 412px; \" /></p>\n\n<p>Once you\'ve entered the connection details, click \"Test Connection...\" to make sure the settings are correct. You should get a \"Connection successful\" response. If you don\'t, the check the details and make sure that you have MySQL running.</p>\n\n<p>Assuming the connection is working, click \"Finish\".</p>\n\n<h2>Adding a Data Set</h2>\n\n<p>To include data form a data source in a report, a data set is needed. This defines the query to run on the database to extract the information for the report.</p>\n\n<p>Back in the Data tab, right click on Data Set, and select \"New Data Set\" form the context menu.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+13.jpg\" style=\"width: 819px; height: 559px; \" /></p>\n\n<p>Make sure the \"OpenActuary Data Source\" is selected under JDBC Data Source, and enter polPolicy as a \"Data Set Name\", then click \"Next &gt;\".</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+14.jpg\" style=\"width: 658px; height: 510px; \" /></p>\n\n<p>Now we can define the query. Fill in the Query text field as shown below, and click Finished.</p>\n\n<p style=\"text-align: center; \"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Birt&amp;fileName=screenshot+15.jpg\" style=\"width: 660px; height: 493px; \" /></p>\n\n<p>A dialog box with then open showing you the columns that result from the query. You can make changes here if necessary, but in this case we just want accept them all. So click \"OK\" without changing anything.</p>\n\n<p>Now that you have the database defined, and the data set defined, all you need to do is design the report to use them.</p>','','html',1,'','',0,10436,'Adam OpenUnderwriter','2014-02-18 17:32:09'),('aacedb7c-3125-4e19-bf77-f1ae1e54acfd',37958,37139,10197,10157,10436,'Adam OpenUnderwriter','2014-02-18 17:39:05','2014-02-18 17:39:05',25363,'First Steps With Talend',1.1,0,'<h1>Introduction</h1>\n\n<p>Talend in an open source tool data integration tool (also known as ETL or Extract Translate Load). It provides a host of features which greatly simplify the job of moving data from one source to another, whether the data is stored in database, spreadsheets or XML files (etc). It is perfectly placed to help with the job of extracting data from a company\'s internal data stores, translating it into a form which can be used within OpenActuary, and loading it into an OpenActuary staging area.</p>\n\n<p>This tutorial will take you through process of installing talend, and gets you up and running with a project that can access the Metropolitan Insurance staging database which is included in a default OpenActuary installation. We\'ll also include some pointers to other useful tutorials and online resources to help you get started with using Talend in anger.</p>\n\n<p>The tutorial assumes that you have no previous experience of Talend.</p>\n\n<h2>Installing Talend</h2>\n\n<p>Talend is available in a number of flavours to support different kinds of ETL related activities. The one we\'re interested in is \"Talend Open Studio for Data Integration\".&nbsp;Talend runs within the Eclipse IDE framework but it cannot be installed as an Eclipse plugin. However, downloads are provided for Windows, MacOS and Linux.</p>\n\n<p>You can <a href=\"http://www.talend.com/download/data-integration\">download it here</a>. Version 5.3.1 or later is recommended. Once you\'ve downloaded the .zip file, unpack it into a convenient folder on your machine.</p>\n\n<p>In Talend\'s installation folder you\'ll find a variety of ways to start the tool depending on your operating system. Which ever of those you choose to run, you will ultimately arrive at Talend\'s startup screen:</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+1.jpg\" style=\"width: 572px; height: 241px;\" /></p>\n\n<h2>Creating a Project</h2>\n\n<p>The first thing we will need is a project to work in. Projects in Talend, in common with other Eclipse based tools, are arranged into workspaces. From this screen you can change the location of the folder where workspaces are stored, but for now just accept the default on this, and simply click the \"Create...\" button.</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+2.jpg\" style=\"width: 420px; height: 334px;\" /></p>\n\n<p>Enter a project name of \"ARDR Motor\" and click \"Finish\". You\'ll be returned to the start screen with the new project pre-selected. So you can simply click \"Open\" to open the project.</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+3.jpg\" style=\"width: 572px; height: 241px;\" /></p>\n\n<p>Now you get the option to connect to the online community. You\'ll get this option every time you open a project if you\'re not already connected. You might want to connect later, but for now just hit \"Skip\".</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+4.jpg\" style=\"width: 536px; height: 418px;\" /></p>\n\n<p>Talend will now load, and after running some project setup steps it will present you with the welcome screen. There are some useful links here to tutorials and online help that you might want to explore later, but we want to get into the tool itself right away so click \"Start Now!\".</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+5.jpg\" style=\"width: 930px; height: 718px;\" /></p>\n\n<p>Talend now opens showing your new project. If you\'re familiar with Eclipse already, you\'ll feel at home right away. If not, you essentially have a panel top-left which displays the content of your project. The \"Repository\" view which you see there now gives you a structured overview of the components of your project. The \"Navigator\" view lets you interact with the files directly. We\'ll still with the \"Repository\" view for now.</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+6.jpg\" style=\"width: 930px; height: 718px;\" /></p>\n\n<p>The centre of the screen which currently shows the welcome message is the work area where we\'ll be designing the ETL job. The bottom of the screen shows status and property editors, and the right hand side will display a palette of ETL modules once we get going.</p>\n\n<p>Right click on \"Job Designs\" in the \"Repository\" view, then select \"Create Job\" from the context menu.</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+7.jpg\" style=\"width: 523px; height: 468px;\" /></p>\n\n<p>Fill in the Name field as \"UploadToMotorStaging\" and leave the other fields as they are and click \"Finish\". As the message says, it is advisable to fill in the Purpose and Description fields and it is probably good practice too,&nbsp; but Talend renders these in tooltips over menu items when you\'re working on a project. So they actually get in the way and are better off left blank.</p>\n\n<p>Your new Job now opens in the job designer, and the panel on the right of the display is populated with ETL modules that you can add to your design.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+8.jpg\" style=\"width: 930px; height: 718px;\" /></p>\n\n<h2>Creating a Database Connection</h2>\n\n<p>Before we get into designing the job itself, we need to configure a database connection and import the table structure into Talend. To do this, start by adding a new connection. Click on the \"Create\" icon in the icon bar</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+10.jpg\" style=\"width: 292px; height: 73px;\" /></p>\n\n<p>And then select \"Create connection\" from the menu:</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+11.jpg\" style=\"width: 930px; height: 718px;\" /></p>\n\n<p>You\'ll be prompted to select a folder for the new connection, just click \"OK\" on this dialog to open the \"New Database Connection\" window.</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+12.jpg\" style=\"width: 696px; height: 648px;\" /></p>\n\n<p>Enter the new \"MotorStagingDatabase\", and click \"Next &gt;\".</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+13.jpg\" style=\"width: 671px; height: 636px;\" /></p>\n\n<p>In order to fill this form in we\'ll need to login to OpenActuary\'s web interface as the user who will be running this ETL job and fetch the database details form the data source view. In this case we\'re going to be running the job as the user \"Lily\" who works for Metropolitan Insurance. Login in as her, and going to the \"Sources\" tab for staging database gives us the following screen detailing the database connection to use.</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+14.jpg\" style=\"width: 822px; height: 726px;\" /></p>\n\n<p>Copying these details into Talend\'s \"New Database Connection\" window results in the following:</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+15.jpg\" style=\"width: 683px; height: 654px;\" /></p>\n\n<p>Click the \"Check\" button to test the settings and ensure that Talend can see the database. This should report a successful connection. If it doesn\'t then check that you have the database settings exactly as shown on OpenActuary\'s Sources tab, and also make sure that you have MySQL running.</p>\n\n<p>Now click \"Finish\" to save the database settings into the project.</p>\n\n<h2>Importing a Database Schema</h2>\n\n<p>Next we need to import the databases\' schema into the project. To do this, right click on&nbsp; \"MotorStagingDatabase 1.0\" in the Repository view under \"Metadata/Db Connections\", and select \"Retrieve Schema\" from the context menu. Note: if you don\'t get a context menu then save your project and restart Talend. After the restart the context menu will work correctly.</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+16.jpg\" style=\"width: 774px; height: 596px;\" /></p>\n\n<p>On the first screen of the import wizard, accept the defaults and click \"Next &gt;\"</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+17.jpg\" style=\"width: 309px; height: 241px;\" /></p>\n\n<p>On the second screen of the import wizard, click on the icon next to \"MetropolitanInsurance_Motor_Staging to open up the tree listing the tables. Then click \"Select All\" to import all of the tables into the project, then click \"Next &gt;\"</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+18.jpg\" style=\"width: 782px; height: 610px;\" /></p>\n\n<p>and on the last screen of the wizard simply click \"Finish\". You have the option on this last screen to add or remove elements from list that will be imported, but in this case we will simply import them all.</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+19.jpg\" style=\"width: 778px; height: 600px;\" /></p>\n\n<h2>Creating the ETL Job</h2>\n\n<p>Now that the database is setup and the schema imported, we can start to design the job itself.</p>\n\n<p>We want to sent the output of the new job into OpenActuary\'s motor staging database. So, click on \"Databases\" in the palette list, then scroll down until you find MySQL. Click on that to open it, and you\'ll get a list of MySQL specific modules.</p>\n\n<p>We want to send our output to MySQL, so look for the module named \"tMysqlOutput\". Drag that module onto the job design.</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+9.jpg\" style=\"width: 930px; height: 718px;\" /></p>\n\n<p>Double clicking the database icon on the newly added module will open the component details view at the bottom of the window. Here we can configure the database that this component will output to.</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+20.jpg\" style=\"width: 930px; height: 718px;\" /></p>\n\n<p>In the component view, set \"Property Type\" to \"Repository\" and click the ellipsis that appears over to it\'s right. From the resulting dialog, select the \"MotorStagingDatabase 1.0\", and click OK. The database connection details will now be filled in based on the connection we defined earlier.</p>\n\n<p>Again in the component view, click the ellipsis next to the \"Table\" text area. Expand the table list in the resulting dialog and select \"polPolicy\". The root element in all OpenActuary databases is the policy table. We will add more tables to the job later, but this is the starting point.</p>\n\n<p>In the component view again, set \"Schema\" to \"Repository\". Talend will automatically select the schema we imported earlier.</p>\n\n<p>The component view should now look like this:</p>\n\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=First+Steps+With+Talend&amp;fileName=Screenshot+21.jpg\" style=\"width: 563px; height: 339px;\" /></p>\n\n<p>The database connection is now ready to be used from the ETL Job. The only thing left to do now, is to find some data to load into it!</p>','','html',1,'','',0,10436,'Adam OpenUnderwriter','2014-02-18 17:39:05'),('37fc26d5-5bad-4793-b003-36883ab06098',38208,38209,10197,10157,10436,'Adam OpenUnderwriter','2014-02-18 22:42:40','2014-02-18 22:42:40',25363,'Motor Schema',1,0,'\\\\','','html',0,'','',0,10436,'Adam OpenUnderwriter','2014-02-18 22:42:40'),('87c0943a-6402-4ce9-b360-1c2ef7022b1d',38275,38209,10197,10157,10436,'Adam OpenUnderwriter','2014-02-18 22:44:19','2014-02-18 22:44:19',25363,'Motor Schema',1.1,0,'<link rel=\"stylesheet\" type=\"text/css\" href=\"/c/wiki/get_page_attachment?nodeId=25363&title=Motor+Schema&fileName=report.css\" />\n<div style=\"width:100%\">\n	<table class=\"CoverPageBorder\">\n		<tr>\n			<td class=\"CoverPageTopBorderToReportTitleSpan\">\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><span class=\"CoverPageReportTitleText\">Motor Actuarial DB Model<br>Pilot Project<br> <br>V1.0.0</span>\n			</td>\n		</tr>\n		<tr>\n			<td>\n				<center>\n					<div class=\"CoverPageReportTitleUnderline\">\n					</div>\n				</center>\n			</td>\n		</tr>\n		<tr>\n			<td class=\"CoverPageReportTitleToOrganizationNameSpan\">\n			</