Standard',1.1,0,'<h1>Introduction</h1>\n\n<p>This document defines a set of common approaches that we expect to be applied to all schema designs. Beyond those things that we just consider to be best-practice in schema design generally, the overriding requirements for OpenActuary schema design are ease of comprehension and is ease of use. It is seen as critical to the success of OpenActuary that anyone who is exposed to the schema can quickly grasp the concepts being represented and can extract meaningful result sets from it, and insert new data, &nbsp;without the need for overly complex queries.</p>\n\n<p>We are not proposing that these conventions represent best practice for schema design in any context other than OpenActuary, but we think it does meet our specific requirements well.</p>\n\n<h2>Principals</h2>\n\n<ol>\n	<li><strong>Three letter prefixes are applied to all table names</strong>.\n\n	<p>For example: Policy would become polPolicy, claim would be claClaim.</p>\n\n	<p>On its own, this principal is not of much value. However, in combination with 2. and 3. it clarifies the structure by clearly defining the prefix used for all data. For example, without further investigation, a user will know that polNumber is the number from the policy table.</p>\n	</li>\n	<li><strong>All column names carry the table name\'s prefix</strong>.\n	<p>For example: Number in the polPolicy table becomes polNumber, Number in the claClaim table becomes claNumber.</p>\n\n	<p>This makes it easier to write queries, as aliases are less frequently needed, and also makes queries shorter and easier to understand as each column in a result set automatically identifies the table it came from.</p>\n	</li>\n	<li><strong>Table and column names camel format (starting with lower case).</strong>\n	<p>For example, a table representing the claim handler concept might be clhClaimHandler (not ClhClaimHandler, or clh_claim_handler). Column names follow the same convention.</p>\n	</li>\n	<li><strong>All tables have and ID column</strong>.\n	<p>With the exception of ENUMS (more later on them), natural IDs are avoided in favour or system generated IDs.Following the rules above, the ID for the polPolicy table would be polID.</p>\n	</li>\n	<li><strong>Foreign key names identify the table they point to</strong>.\n	<p>Foreign keys adopt the convention of always ending with ID&lt;table prefix&gt;. A foreign key in the claClaim referring to polPolicy would therefore be named claIDpol.</p>\n	</li>\n	<li><strong>Full words are preferred in column names</strong>.\n	<p>It is quite common to find TLAs and vowel-dropping or short-name techniques used in database design. It is our observation that this leads to inconsistency, which makes queries harder to write/understand, and misunderstandings which impact the comprehensibility of the schema. Therefore, for example, the concept of expiry date in a policy would be represented as polExpiryDate, not polExpDt or polExDate etc.</p>\n\n	<p>When a column name does become long to the point of being unwieldy, the first suggestion is to take a step back and look at the schema as a whole. An unwieldy column name can be an indication that the table structure itself is at fault. Remove repetition in the name, polPolicyNumberOutwardsInsurance could be shortened to polNumberOutwards for example.</p>\n	</li>\n</ol>\n\n<h2>Enumerations</h2>\n\n<p>The topic of enumerations (or codes) is worthy of a section in its own right. There are a number of common approaches used in database design to handle the concept of enumerations. Each has advantages, but we think that the approach outlined here best fits our requirements for ease of use and comprehensibility.</p>\n\n<h3>Approaches considered</h3>\n\n<ul>\n	<li>\n	<p>Using the ENUM column types. Many databases (MySQL included) support the column type of ENUM. This allows the list of enumeration values to be defined as part of the table definition. The advantage of this approach is that the values themselves are used directly in queries (without joins), and appear directly in result sets. However, they work less well in our context because whilst some enumeration lists are very unlikely to ever change (take Gender (Male,Female) as an example!) others, like currency and country, change quite frequently. As OpenActuary expects to hold historical information it is important that we can easily identify which values for a given enumeration were valid for which dates. The ENUM column type has no support for additional constraints like validTo and validFrom dates.</p>\n	</li>\n	<li>\n	<p>Classification Scheme/Classification. This is another common approach where two tables are used to represent the enumeration types (classification scheme) and the enumeration values (classification). Classification has a foreign key to classification scheme to tie each value to the scheme to which it belongs. The advantage of this approach is that it uses just two tables to represent all enumeration types and values and that those values are extensible without schema modification. It has disadvantages too though: It isn\'t \"type safe\" - i.e. there is nothing to prevent the polPolicy table\'s polCover column being populated with \"Male\" from the Gender enumeration when it should only be possible to populate it with a value from the CoverType enumeration. It also requires the use of joins and aliases to extract meaningful results (as opposed to IDs).</p>\n	</li>\n</ul>\n\n<h3>Approach adopted</h3>\n\n<ul>\n	<li>\n	<p>Each enumeration type is defined by its own table<br />\n	Each row of an enum table defines a valid value for the enum. The standard columns are: name, validFrom and validTo.</p>\n	</li>\n	<li>\n	<p>The name column will be the primary key.</p>\n	</li>\n	<li>\n	<p>Each enumeration table will carry a prefix (exactly as other tables do), the prefix is followed by the letters EN to identify the table as an enumeration, this is followed by the name. e.g. makENMake, curENCurrency.</p>\n	</li>\n	<li>\n	<p>The aim of this is to clearly partition enumeration tables from data tables. In the absence of this convention the schema would appear far more complex than it is.</p>\n	</li>\n</ul>\n\n<p>The advantages of this approach are that it is type safe (like the ENUM column type), and is also capable of supporting validTo and validFrom dates (like Classification Scheme/Classification). As the primary key is the char value of the enumeration queries are simpler to write and result sets are easier to understand without the need for joins or aliases (like ENUM).</p>\n\n<h2>Sample Scheme</h2>\n\n<p>The following example schema and data extract outlines all the main features of these standards.</p>\n\n<p><img alt=\"\" src=\"http://localhost:8080/c/wiki/get_page_attachment?p_l_id=25215&amp;nodeId=25363&amp;title=Schema+Standard&amp;fileName=Entity Relationship Diagram1.jpg\" /></p>\n\n<p>Sample standing data for enumCover table</p>\n\n<table border=\"1\" style=\"width: 500px;\">\n	<thead>\n		<tr>\n			<th>Name</th>\n			<th>Valid from</th>\n			<th>Valid to</th>\n		</tr>\n	</thead>\n	<tbody>\n		<tr>\n			<td>THIRD_PARTY</td>\n			<td>NULL</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>THIRD_PARTY_FIRE_AND_THEFT</td>\n			<td>NULL</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>COMPREHENSIVE</td>\n			<td>NULL</td>\n			<td>NULL</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>Sample standing data for enumBodyType table</p>\n\n<table border=\"1\" style=\"width: 500px;\">\n	<thead>\n		<tr>\n			<th>Name</th>\n			<th>Valid from</th>\n			<th>Valid to</th>\n		</tr>\n	</thead>\n	<tbody>\n		<tr>\n			<td>CONVERTIBLE</td>\n			<td>NULL</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>HATCHBACK</td>\n			<td>NULL</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>ESTATE</td>\n			<td>NULL</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>SALOON</td>\n			<td>NULL</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>COUPE</td>\n			<td>NULL</td>\n			<td>NULL</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>Sample standing data for enumMake table</p>\n\n<table border=\"1\" style=\"width: 500px;\">\n	<thead>\n		<tr>\n			<th>Name</th>\n			<th>makeID</th>\n		</tr>\n	</thead>\n	<tbody>\n		<tr>\n			<td>FORD</td>\n			<td>1</td>\n		</tr>\n		<tr>\n			<td>FIAT</td>\n			<td>2</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>Sample standing data for enumModel table</p>\n\n<table border=\"1\" style=\"width: 500px;\">\n	<thead>\n		<tr>\n			<th>Name</th>\n			<th>makeID</th>\n		</tr>\n	</thead>\n	<tbody>\n		<tr>\n			<td>FIESTA</td>\n			<td>1</td>\n		</tr>\n		<tr>\n			<td>MONDEO</td>\n			<td>2</td>\n		</tr>\n		<tr>\n			<td>FOCUS</td>\n			<td>3</td>\n		</tr>\n		<tr>\n			<td>KUGA</td>\n			<td>4</td>\n		</tr>\n		<tr>\n			<td>MODEL-T</td>\n			<td>5</td>\n		</tr>\n		<tr>\n			<td>DOBLO</td>\n			<td>6</td>\n		</tr>\n		<tr>\n			<td>PANDA</td>\n			<td>7</td>\n		</tr>\n		<tr>\n			<td>BRAVO</td>\n			<td>8</td>\n		</tr>\n		<tr>\n			<td>500C</td>\n			<td>9</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>Sample standing data for cascadeMakeModel table</p>\n\n<table border=\"1\" style=\"width: 500px;\">\n	<thead>\n		<tr>\n			<th>makeID</th>\n			<th>modelID</th>\n			<th>Valid from</th>\n			<th>Valid to</th>\n		</tr>\n	</thead>\n	<tbody>\n		<tr>\n			<td>1</td>\n			<td>1</td>\n			<td>1976</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>1</td>\n			<td>2</td>\n			<td>1993</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>1</td>\n			<td>3</td>\n			<td>1998</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>1</td>\n			<td>4</td>\n			<td>2008</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>1</td>\n			<td>5</td>\n			<td>1908</td>\n			<td>1927</td>\n		</tr>\n		<tr>\n			<td>2</td>\n			<td>6</td>\n			<td>2001</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>2</td>\n			<td>7</td>\n			<td>2003</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>2</td>\n			<td>8</td>\n			<td>2007</td>\n			<td>NULL</td>\n		</tr>\n		<tr>\n			<td>2</td>\n			<td>9</td>\n			<td>2009</td>\n			<td>NULL</td>\n		</tr>\n	</tbody>\n</table>','','html',1,'','',0,10436,'Adam OpenUnderwriter','2014-02-18 23:27:16'),('558c3f60-1220-4fcd-9a63-3cf80559e31e',38911,38912,10197,10157,10161,'','2014-02-19 21:21:47','2014-02-19 21:21:47',25363,'FrontPage',1,1,'','New','creole',0,'','',0,10161,'','2014-02-19 21:21:48'),('51b73c0a-3411-47d1-b5a1-800e3b6512b0',38919,38912,10197,10157,10436,'Adam OpenUnderwriter','2014-02-19 21:22:28','2014-02-19 21:22:28',25363,'FrontPage',1.1,0,'<p>Welcome to the OpenUnderwriter help pages.</p>\n\n<p>These pages are made up of HOW-TOs, user guides, reference information and other articles which are provided as part of OpenUnderwriter. The articles have been contributed by the OpenUnderwriter team and other contributors from the user community. We hope you find them useful! You are very much encouraged to make use of these articles and to contribute to them. We value any contribution; from&nbsp;correcting spelling mistakes to providing completly new articles, all improvements are helpful to the community.</p>\n\n<p>Like OpenUnderwriter itself, all of these articles are open source and are covered by the GPL license.</p>\n\n<h1>OpenUnderwriter</h1>\n\n<p>This section includes articles which are relevant to OpenUnderwriter as a whole rather than being specific to one of the applications.</p>\n\n<h1>OpenQuote</h1>\n\n<ul>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&_54_INSTANCE_vJaFXJrvjXZk_title=Product+Development+Tutorial\">Product Development Tutorial</a>\n\n	<p>This tutorial takes you through the process of modifying an existing product to include a new question, and how the answer that a proposer gives to that question can be used to influence rating and referral rules.</p>\n	</li>\n</ul>\n\n<h1>OpenActuary</h1>\n\n<ul>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&_54_INSTANCE_vJaFXJrvjXZk_title=Schema+Standard\">Schema Standards</a>\n\n	<p>A suggested standard defining a set of conventions aimed at making actuarial repository databases easier to use and manage.</p>\n	</li>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&_54_INSTANCE_vJaFXJrvjXZk_title=Motor+Schema\">Motor Schema</a>\n\n	<p>The detailed definition of a schema for Motor data.&nbsp;This schema is used by the demonstration included in OpenActuary and implements the above standards.</p>\n	</li>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&_54_INSTANCE_vJaFXJrvjXZk_title=First+Steps+With+Talend\">First Steps in Talend</a>\n\n	<p>Tutorial that takes you though the process of installing and using the Talend ETL tool to access an OpenActuary actuarial repository.</p>\n	</li>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&_54_INSTANCE_vJaFXJrvjXZk_title=First+Steps+With+Birt\">First Steps in Birt</a>\n\n	<p>A step by step guide to installing and using the Birt reporting tool to access information held in an OpenActuary repository.</p>\n	</li>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&_54_INSTANCE_vJaFXJrvjXZk_title=ETL+Scenarios\">ETL Scenarios</a>\n\n	<p>This article outlines an approach to performing ETL exports to an OpenActuary repository. Motor is used as an example, but the approach is valid elsewhere.</p>\n	</li>\n</ul>','','html',0,'','',0,10436,'Adam OpenUnderwriter','2014-02-19 21:22:28'),('4856cf4e-e4a9-40d5-bd76-055705f860f3',40637,37107,10197,10157,10436,'Adam OpenUnderwriter','2014-03-10 17:58:42','2014-03-10 17:58:42',25363,'Product Development Tutorial',1.2,0,'<h1>Introduction</h1>\n\n<p>This tutorial gives an overview of product development within OpenUnderwriter.</p>\n\n<p>This tutorial describes the process of making an update to an existing product definition. Using the FreightPlus demonstration product as a starting point, it adds a new question to the product\'s quotation screens and modifies the product\'s rating rules to take the answer to the new question into account during rating.</p>\n\n<p>The FreightPlus product is concerned with quoting for personal shipping insurance. While simple, it does represent a real world solution developed for one of OpenUnderwriter\'s clients. The additional question which will be added describes the type of commodity that is being shipped. The type will affect the premium. For example, the premium for refrigerated goods will be higher than that for dry goods. Four types of commodities are used: Dry, Refrigerated, Live and Other.</p>\n\n<h1>Requirements</h1>\n\n<ul>\n	<li>\n	<p>An running instance of OpenUnderwriter, version 2.0 or later, running on localhost.</p>\n	</li>\n	<li>\n	<p>A text editor. Notepad is fine on windows as is TextEdit (or&nbsp;vi, emacs) on a Mac.</p>\n	</li>\n	<li>\n	<p>A Excel compatible spreadsheet editor. Excel itself is fine, as are&nbsp;Libra office or OpenOffice.</p>\n	</li>\n</ul>\n\n<table border=\"0\" cellpadding=\"5\" cellspacing=\"1\" class=\"tip\">\n	<tbody>\n		<tr>\n			<td><span style=\"color: rgb(102, 102, 102);\">For simplicity this tutorial only requires using a text editor for updating most product resources. However, product development is normally carried out using some kind of IDE. Eclipse, NetBeans or InteliiJ are recommended. The features that these tools offer, like syntax highlighting, make it far easier to edit product resources.&nbsp;</span></td>\n		</tr>\n	</tbody>\n</table>\n\n<h1>The Product Development Sandpit</h1>\n\n<p>The sandpit screen is a feature of OpenUnderwriter that provides an environment where products can be executed and debugged. This tutorial will make extensive use of this feature. The sandpit can be opened using the following URL:</p>\n\n<p><code style=\"margin-left: 40px;\"><a href=\"/web/oq/sandpit\">http://localhost:8080/web/oq/sandpit</a></code></p>\n\n<p>Use the login: <code>katie@openunderwriter.org</code>, password: <code>katie</code>.</p>\n\n<table border=\"0\" cellpadding=\"5\" cellspacing=\"1\" class=\"tip\">\n	<tbody>\n		<tr>\n			<td><span style=\"color: rgb(102, 102, 102);\">Katie is one of a number of demonstration users who are created in a default installation. Katie is setup in the role of \"Product Developer\", and as such she has access to the sandpit. Other users, depending on their roles, may or may not have access.</span></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>Once logged in, the following sandpit screen will be displayed.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=Unknown.gif\" style=\"width: 1024px; height: 551px;\" /></p>\n\n<p>The main area of this screen is given over to displaying the product screens. No product is selected yet, so at this point it is blank. Above this is a panel that allows you to select products to work on&nbsp;and control various aspects of the process.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=control-2.gif\" style=\"width: 1024px; height: 46px;\" /></p>\n\n<h1>Freight Plus Product Walkthrough</h1>\n\n<p>Now select \"<code>AIL.Demo.FreightPlus</code>\" in the <strong>Product?</strong> drop down, and \"<code>QuotationPageFlow</code>\" in the <strong>PageFlow?</strong> drop down.&nbsp;</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=control-closeup.gif\" style=\"width: 600px; height: 87px;\" /></p>\n\n<p>After a short delay as the product is loaded,&nbsp;OpenUnderwriter will&nbsp;display the product\'s first page, the \"Welcome\" page. The product panel now shows exactly the same questions and options that a user would see when they visit the site for a FreightPlus quotation.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=questions.gif\" style=\"width: 1024px; height: 569px;\" /></p>\n\n<p>The FreightPlus product generates quotations for personal freight transportation insurance. With the product in it\'s default state only 4 questions need to be answered before a quotation or referral is presented. Over the course of the next sections in this tutorial an additional question will be added.</p>\n\n<p>For now, carry on with the quotation process by selecting the following options.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=questions.gif\" style=\"width: 1024px; height: 569px;\" /></p>\n\n<p>Now hit \"<strong>Quote</strong>\" and the quote will be rated. In this case the next screen displayed is the quotation screen, including the premium and some options for what to do next.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=quote.gif\" style=\"width: 1024px; height: 564px;\" /></p>\n\n<p>From there you can Save the quote so you can return to it later, or Requote which will take you back to the first page, but pre-fill it with the answers your originally gave. Hitting Quote Document will generate a quotation document, and Confirm and Pay will take you to further screens where you enter policy holder and payment information. Quit will restart the pageflow.</p>\n\n<p>Hit \"<strong>Quit</strong>\" to return to quit this quotation and restart the pageflow.</p>\n\n<p>If values are entered on the first screen for which a quote cannot be produced, a referral is generated. Entering the following values will have that effect.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=questons-refer.gif\" style=\"width: 1024px; height: 565px;\" /></p>\n\n<p>Hitting quote with these values will take you to the referral screen:</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=refer.gif\" style=\"width: 1024px; height: 568px;\" /></p>\n\n<p>In this case the only options are to Requote or Quit which have the same effect as they did on the quotation page.</p>\n\n<h1>Product Development Environment</h1>\n\n<p>All the aspects of the FreightPlus product that have been seen so far are configurable. And all are defined as part of a product definition. Product definitions are held within OpenUnderwriter\'s document library and can be accessed as files from your desktop.</p>\n\n<h2>MacOSX Setup</h2>\n\n<p>On a Mac, use Finder to connect to a server:</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=finder.gif\" style=\"width: 480px; height: 359px;\" /></p>\n\n<p>Enter <code>http://localhost:8080/webdav/global/document_library/Product/AIL/Demo/FreightPlus</code> as the server address, and click \"<strong>Connect</strong>\".</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=server.gif\" style=\"width: 480px; height: 335px;\" /></p>\n\n<p>Enter the username <code>katie@openunderwriter.org</code> with the password <code>katie</code>, and click \"<strong>Connect</strong>\".</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=finder-login.gif\" style=\"width: 480px; height: 312px;\" /></p>\n\n<p>A new Finder window will open displaying the product definition.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=product-files.gif\" style=\"width: 512px; height: 286px;\" /></p>\n\n<h2>Windows Setup</h2>\n\n<p>From the Windows Start menu, right click on \"Computer\" and select \"Map network drive...\".</p>\n\n<p><img alt=\"\" src=\"http://localhost:8080/c/wiki/get_page_attachment?p_l_id=25215&amp;nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=start-menu.gif\" style=\"width: 480px; height: 444px;\" /></p>\n\n<p><span style=\"color: rgb(102, 102, 102);\">Select any free drive letter (P: for product is logical), and enter&nbsp;</span><code style=\"color: rgb(102, 102, 102);\">http://localhost:8080/webdav/global/document_library/Product/AIL/Demo/FreightPlus</code><span style=\"color: rgb(102, 102, 102);\">&nbsp;as the folder URL.&nbsp;Check the \"Connect using different credentials\",&nbsp;and click \"</span><strong style=\"color: rgb(102, 102, 102);\">Finish</strong><span style=\"color: rgb(102, 102, 102);\">\".</span></p>\n\n<p><span style=\"color: rgb(102, 102, 102);\"><img alt=\"\" src=\"http://localhost:8080/c/wiki/get_page_attachment?p_l_id=25215&amp;nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=map-drive.gif\" style=\"width: 480px; height: 351px;\" /></span></p>\n\n<p><span style=\"color: rgb(102, 102, 102);\">Enter the username&nbsp;</span><code style=\"color: rgb(102, 102, 102);\">katie@openunderwriter.org</code><span style=\"color: rgb(102, 102, 102);\">&nbsp;with the password&nbsp;</span><code style=\"color: rgb(102, 102, 102);\">katie</code><span style=\"color: rgb(102, 102, 102);\">, and click \"<strong>OK</strong>\".</span></p>\n\n<p><span style=\"color: rgb(102, 102, 102);\"><img alt=\"\" src=\"http://localhost:8080/c/wiki/get_page_attachment?p_l_id=25215&amp;nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=explorer-login.gif\" style=\"width: 400px; height: 300px;\" /></span></p>\n\n<p>An explorer window will open displaying the product definition:</p>\n\n<p><img alt=\"\" src=\"http://localhost:8080/c/wiki/get_page_attachment?p_l_id=25215&amp;nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=explorer.gif\" style=\"width: 480px; height: 376px;\" /></p>\n\n<h1>Adding the new question</h1>\n\n<p>To add a question to a product the product\'s pageflow is updated to define where the new question should appear and how it should be worded, and the product\'s model is updated to define how the answer is stored and any validations that should be applied to it.</p>\n\n<p>In the product definition, open the file <code>PageFlows/QuotationPageFlow.xml</code> in a text editor.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=pageflow-1.gif\" style=\"width: 820px; height: 347px;\" /></p>\n\n<p>This file contains defines the questions that will be asked. There are four at the moment (highlighted above). Add a new question by inserting the following text as shown in the screenshot below:</p>\n\n<p style=\"margin-left: 40px;\"><code>&lt;question title=\"What category of commodity are you shipping?\" binding=\"/asset/attribute[id=\'commodity\']\" /&gt;</code></p>\n\n<p>The following screenshot shows the modified file with the new line highlighted.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=pageflow-2.gif\" style=\"width: 840px; height: 354px;\" /></p>\n\n<p>Save the file.</p>\n\n<p>Now open the file <code>Model/Quotation.xml</code> in a text editor.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=quotation-1.gif\" style=\"width: 840px; height: 323px;\" /></p>\n\n<p>This file defines the structure of the quotation. This structure is modified to add a place to store the result from the new question, and to define the valid values for the answer. Add the following line as shown in the screenshot below:</p>\n\n<p style=\"margin-left: 40px;\"><code>&lt;attribute id=\"commodity\" value=\"?\" format=\"choice,options=-1#?|1#Dry|2#Refrigerated|3#Live|4#Other\" /&gt;</code></p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=quotation-2.gif\" style=\"width: 840px; height: 323px;\" /></p>\n\n<p>Save the file.</p>\n\n<h1>Testing the new question</h1>\n\n<p>The changes made in the previous section are immediately picked up. Return to the sandpit, and the new question is now displayed including appropriate values in for the answer.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=new-questions.gif\" style=\"width: 1024px; height: 603px;\" /></p>\n\n<table border=\"0\" cellpadding=\"5\" cellspacing=\"1\" class=\"tip\">\n	<tbody>\n		<tr>\n			<td>If you had quit your browser session, login and open the FreightPlus product in the sandpit as before. Otherwise, hit the green restart button (<img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=17.png\" style=\"width: 22px; height: 22px; box-shadow: none; margin: 0px;\" />) on the sandpit or refresh the browser to pick up the new question.</td>\n		</tr>\n	</tbody>\n</table>\n\n<h1>Rating changes</h1>\n\n<p>With the question added and the model updated to hold the answer, the next step is to take this new information into account during rating. The following changes will be made:</p>\n\n<p>&nbsp;&nbsp; &nbsp;-&nbsp;&nbsp; &nbsp;A commodity type of Refrigerated will attract a 10% loading, Live will attract a 15% loading. Other will cause a referral. Selecting Dry will leave the behaviour unchanged.</p>\n\n<p>The rating rules for FreightPlus are defined in the form of a spreadsheet. Changing the rules to take into account the new information simply involves editing that spreadsheet. From the product definition folder, open the file Rules/PolicyRating.xls in Excel, Libra Office or a similar tool.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-1.gif\" style=\"width: 1024px; height: 855px;\" /></p>\n\n<p>The spreadsheet is broken into tables. In this case there are two, one (very long) table detailing rating by destination and mode of transport, and another further down which handles the answer to the \"Would you like cover for shipping delay?\" question.</p>\n\n<p>Each table is layer out with conditions on the left, and actions on the right. At the top of the first table are the rules covering UK destinations, then European Union etc. The first few rows say, in effect:</p>\n\n<p>&nbsp;&nbsp; &nbsp;If the destination is UK and the mode of transport is Road, then apply a premium rate of 0.5%.<br />\n&nbsp;&nbsp; &nbsp;If the destination is UK and the mode of transport is Rail, then apply a premium rate to 0.4%.<br />\n&nbsp;&nbsp; &nbsp;If the destination is UK and the mode of transport is Sea, then refer the quotation.<br />\n&nbsp;&nbsp; &nbsp;If the destination is UK and the mode of transport is Air, then refer the quotation.</p>\n\n<p>A new table will be added at the end of the spreadsheet to include the new rules for commodity.&nbsp;</p>\n\n<p>To make the spreadsheet more readable, especially when it may be shared with non-technical users, the control rows which allow OpenUnderwriter to interpret the spreadsheet\'s content are normally hidden. Click the + sign next to the destinations rating table to reveal the control rows.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=unhide-1.gif\" style=\"width: 559px; height: 116px;\" /></p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=unhide-2.gif\" style=\"width: 1024px; height: 855px;\" /></p>\n\n<p>Take a copy of first 9 rows (rows 40-48)&nbsp;of the table.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-selection.gif\" style=\"width: 1024px; height: 250px;\" /></p>\n\n<p>Paste a copy of these rows at the end of the spreadsheet.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-paste.gif\" style=\"width: 1024px; height: 855px;\" /></p>\n\n<p>For the purposes of this rating change only one condition column is needed, so delete the 1st column of cells in the new table taking care not to delete anything from the 1st row.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-delete.gif\" style=\"width: 1024px; height: 288px;\" />&nbsp;</p>\n\n<p><br />\n<img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-deleted.gif\" style=\"width: 1021px; height: 290px;\" /></p>\n\n<p>The basic structure of the table is now in place, but the cells need to be edited to match the new rating conditions. Ignoring the control cells (in blue) update the other cells to the values&nbsp;shown below.&nbsp;</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-edited.gif\" style=\"width: 1024px; height: 284px;\" /></p>\n\n<table border=\"0\" cellpadding=\"5\" cellspacing=\"1\" class=\"tip\">\n	<tbody>\n		<tr>\n			<td>The \"Dry\" row is not really necessary as it has no actions associated with it, but including all of the possible values helps readability.</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>The last step is to update control information. The control information provides an enormous amount of flexibility and power, but for now simply paste the following values into the cells shown:</p>\n\n<p>&nbsp;<strong>B200</strong>&nbsp;&nbsp; &nbsp;<code>name==\"commodity\", stringValue==\"$1\"</code>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\n&nbsp;<strong>C200</strong>&nbsp;&nbsp; &nbsp;<code>$AssessmentSheetArgRet.addLoading(\"$2\", \"total premium\", \"total premium\", new Rate(\"$1\"));</code><br />\n&nbsp;<strong>D200</strong>&nbsp;&nbsp; &nbsp;<code>$AssessmentSheetArgRet.addReferral(\"$param:\");</code></p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-edited-2.gif\" style=\"width: 1024px; height: 295px;\" /></p>\n\n<table border=\"0\" cellpadding=\"5\" cellspacing=\"1\" class=\"tip\">\n	<tbody>\n		<tr>\n			<td>The styles used in the spreadsheet aren\'t important to OpenUnderwriter, but they do make a huge difference to readability. Deleting the formatting in cell E197, and hiding rows 197 to 200 makes the purpose of the rules clearer. In a commercial setting it is quite common to need a non-technical user to sign-off on changes. This is made easier without the distraction of technical information.</td>\n		</tr>\n	</tbody>\n</table>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-edited-3.gif\" style=\"width: 1024px; height: 374px;\" /></p>\n\n<p>The spreadsheet changes are now complete. Saving it will make the new rules instantly active.</p>\n\n<h1>Testing the new rating</h1>\n\n<p>Return to the sandpit and start a new FreightPlus quotation. The session will probably have time-out by now so it will be necessary to login again and return to the sandpit.</p>\n\n<p>Enter the values below and hit the <strong>Quote</strong> button.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=updated-sandpit.gif\" style=\"width: 1024px; height: 595px;\" /></p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=new-quotation.gif\" style=\"width: 1024px; height: 563px;\" /></p>\n\n<p>The premium is now showing as 110. This suggests that a 10% loading has been added for the Refrigerated commodity option as would be hoped. However, that can be confirmed by switching the sandpit into its \"Assessment Sheet\" view.</p>\n\n<p>In the sandpit\'s control panel, switch the <strong>View</strong> from <strong>Wizard</strong> to <strong>Assessment sheet</strong>.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=assessment-sheet.gif\" style=\"width: 1024px; height: 899px;\" /></p>\n\n<p>The assessment sheet records how OpenUnderwriter arrived at the premium of 110, or in the case of a referral or a decline it would detail how the system arrived at that conclusion. This information is stored with the quote itself so it forms part of the historical record.</p>\n\n<p>In this case the assessment sheet shows that a \"base premium\" of 10 was initially arrived at. The new commodity rule then added a loading to the premium of 10%. It would seem that this should have lead to a total premium of 11, but the total premium is actually shown as 110. What\'s going on?</p>\n\n<p>Looking further down the assessment sheet, there is a note. FreightPlus defines a minimum premium rule which will automatically adjust the base premium up to 100 if it falls below that value. That rule has fired and adjusted the premium. It also inserted this note to explain the apparently strange result.</p>\n\n<p>The note refers to the \"\'31\' control line\". This is a reference to the row in the rating spreadsheet that defines the rule. As it is considered to be a control line the row is normally hidden, but returning to the spreadsheet and unhiding that section revels the following.</p>\n\n<p><img alt=\"\" src=\"/c/wiki/get_page_attachment?nodeId=25363&amp;title=Product+Development+Tutorial&amp;fileName=spreadsheet-control.gif\" style=\"width: 1024px; height: 855px;\" /></p>\n\n<h1>Thank you</h1>\n\n<p>Thank you for using this tutorial, we hope it was helpful to you. Please consider commenting on our forum or giving us a thumbs up on facebook, linkedin or twitter if you have found this tutorial and OpenUnderwriter useful.</p>','','html',1,'','',0,10436,'Adam OpenUnderwriter','2014-03-10 17:58:42'),('64e61c73-9b1c-4bd7-a899-aa478f3f7774',40972,40973,10197,10157,10436,'Adam OpenUnderwriter','2014-03-18 22:51:56','2014-03-18 22:51:56',25363,'/44485',1,0,'<p>The demonstration product sites that come pre-configured in OpenUnderwriter are intended to be, as near as possible, configured in the way that product sites would be configured in a live system. This is good from a demonstration point of view, but it does mean that you will need to carry out some additional system configuration to make them accessible.</p>\n\n<p>Each site is hosted within the server as a separate portal instance. This means that they are effectively separate servers, albeit that they run in the same JVM. This reflects a typical production setup where you would want each server to be separate to allow for completely isolated user accounts and administration rights. There is, of course, nothing at all to stop you from hosting all of your products in one site. If you offer a suite of products to a common user base this would make perfect sense. However, for the purposes of the demonstration product sites, they are separate.</p>\n\n<p>As the sites are separate, they need to have separate domain names. Again, in a production environment, this would not be a problem. You would have registered different domain names. In a demonstration environment though, you will need to create new domain names yourself.</p>\n\n<p>On Unix, or MacOS, you will need to edit the /etc/hosts file. On Windows, edit the file c:\\Windows\\System32\\drivers\\etc\\hosts. Regardless of the operating system, you need to add the same five lines to the file:</p>\n\n<p>127.0.0.1 &nbsp; &nbsp; &nbsp; freightplus.localhost<br />\n127.0.0.1 &nbsp; &nbsp; &nbsp; motorplus.localhost<br />\n127.0.0.1 &nbsp; &nbsp; &nbsp; equineplus.localhost<br />\n127.0.0.1 &nbsp; &nbsp; &nbsp; irishbrokerpi.localhost<br />\n127.0.0.1 &nbsp; &nbsp; &nbsp; lifeplus.localhost</p>\n\n<p>Once you have added these lines, return the OpenQuote home page and the product sites will be available to you.</p>','','html',1,'','',8,10436,'Adam OpenUnderwriter','2014-04-23 11:59:20'),('3b7b879f-d369-47bf-b60b-7c03dbf32446',40980,38912,10197,10157,10436,'Adam OpenUnderwriter','2014-03-18 23:00:41','2014-03-18 23:00:41',25363,'FrontPage',1.2,0,'<p>Welcome to the OpenUnderwriter help pages.</p>\n\n<p>These pages are made up of HOW-TOs, user guides, reference information and other articles which are provided as part of OpenUnderwriter. The articles have been contributed by the OpenUnderwriter team and other contributors from the user community. We hope you find them useful! You are very much encouraged to make use of these articles and to contribute to them. We value any contribution; from&nbsp;correcting spelling mistakes to providing completly new articles, all improvements are helpful to the community.</p>\n\n<p>Like OpenUnderwriter itself, all of these articles are open source and are covered by the GPL license.</p>\n\n<h1>OpenUnderwriter</h1>\n\n<p>This section includes articles which are relevant to OpenUnderwriter as a whole rather than being specific to one of the applications.</p>\n\n<h1>OpenQuote</h1>\n\n<ul>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&amp;_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&amp;_54_INSTANCE_vJaFXJrvjXZk_title=Product+Development+Tutorial\">Product Development Tutorial</a>\n\n	<p>This tutorial takes you through the process of modifying an existing product to include a new question, and how the answer that a proposer gives to that question can be used to influence rating and referral rules.</p>\n	</li>\n   <li><a href=\"/web/oq/help?p_p_id=54_INSTANCE_Jn1ZSv7UjIOf&amp;_54_INSTANCE_Jn1ZSv7UjIOf_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_Jn1ZSv7UjIOf_nodeName=Main&_54_INSTANCE_Jn1ZSv7UjIOf_title=Configuring+the+demonstration+product+sites\">Configuring the Demonstration Product Sites</a>\n<p>Note on how to setup your environment so that you can access the demonstration product sites.</p>\n</li>\n</ul>\n\n<h1>OpenActuary</h1>\n\n<ul>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&amp;_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&amp;_54_INSTANCE_vJaFXJrvjXZk_title=Schema+Standard\">Schema Standards</a>\n\n	<p>A suggested standard defining a set of conventions aimed at making actuarial repository databases easier to use and manage.</p>\n	</li>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&amp;_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&amp;_54_INSTANCE_vJaFXJrvjXZk_title=Motor+Schema\">Motor Schema</a>\n	<p>The detailed definition of a schema for Motor data.&nbsp;This schema is used by the demonstration included in OpenActuary and implements the above standards.</p>\n	</li>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&amp;_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&amp;_54_INSTANCE_vJaFXJrvjXZk_title=First+Steps+With+Talend\">First Steps in Talend</a>\n	<p>Tutorial that takes you though the process of installing and using the Talend ETL tool to access an OpenActuary actuarial repository.</p>\n	</li>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&amp;_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&amp;_54_INSTANCE_vJaFXJrvjXZk_title=First+Steps+With+Birt\">First Steps in Birt</a>\n	<p>A step by step guide to installing and using the Birt reporting tool to access information held in an OpenActuary repository.</p>\n	</li>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&amp;_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&amp;_54_INSTANCE_vJaFXJrvjXZk_title=ETL+Scenarios\">ETL Scenarios</a>\n	<p>This article outlines an approach to performing ETL exports to an OpenActuary repository. Motor is used as an example, but the approach is valid elsewhere.</p>\n	</li>\n</ul>','','html',0,'','',0,10436,'Adam OpenUnderwriter','2014-03-18 23:00:41'),('3875ecd6-942e-42c2-877e-dfcf2aa9d71b',44486,38912,10197,10157,10436,'Adam OpenUnderwriter','2014-04-23 11:59:35','2014-04-23 11:59:35',25363,'FrontPage',1.3,0,'<p>Welcome to the OpenUnderwriter help pages.</p>\n\n<p>These pages are made up of HOW-TOs, user guides, reference information and other articles which are provided as part of OpenUnderwriter. The articles have been contributed by the OpenUnderwriter team and other contributors from the user community. We hope you find them useful! You are very much encouraged to make use of these articles and to contribute to them. We value any contribution; from&nbsp;correcting spelling mistakes to providing completly new articles, all improvements are helpful to the community.</p>\n\n<p>Like OpenUnderwriter itself, all of these articles are open source and are covered by the GPL license.</p>\n\n<h1>OpenUnderwriter</h1>\n\n<p>This section includes articles which are relevant to OpenUnderwriter as a whole rather than being specific to one of the applications.</p>\n\n<h1>OpenQuote</h1>\n\n<ul>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&amp;_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&amp;_54_INSTANCE_vJaFXJrvjXZk_title=Product+Development+Tutorial\">Product Development Tutorial</a>\n\n	<p>This tutorial takes you through the process of modifying an existing product to include a new question, and how the answer that a proposer gives to that question can be used to influence rating and referral rules.</p>\n	</li>\n</ul>\n\n<h1>OpenActuary</h1>\n\n<ul>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&amp;_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&amp;_54_INSTANCE_vJaFXJrvjXZk_title=Schema+Standard\">Schema Standards</a>\n\n	<p>A suggested standard defining a set of conventions aimed at making actuarial repository databases easier to use and manage.</p>\n	</li>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&amp;_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&amp;_54_INSTANCE_vJaFXJrvjXZk_title=Motor+Schema\">Motor Schema</a>\n	<p>The detailed definition of a schema for Motor data.&nbsp;This schema is used by the demonstration included in OpenActuary and implements the above standards.</p>\n	</li>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&amp;_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&amp;_54_INSTANCE_vJaFXJrvjXZk_title=First+Steps+With+Talend\">First Steps in Talend</a>\n	<p>Tutorial that takes you though the process of installing and using the Talend ETL tool to access an OpenActuary actuarial repository.</p>\n	</li>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&amp;_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&amp;_54_INSTANCE_vJaFXJrvjXZk_title=First+Steps+With+Birt\">First Steps in Birt</a>\n	<p>A step by step guide to installing and using the Birt reporting tool to access information held in an OpenActuary repository.</p>\n	</li>\n	<li><a href=\"/web/guest/help?p_p_id=54_INSTANCE_vJaFXJrvjXZk&amp;_54_INSTANCE_vJaFXJrvjXZk_struts_action=%2Fwiki_display%2Fview_page&amp;_54_INSTANCE_vJaFXJrvjXZk_nodeName=Main&amp;_54_INSTANCE_vJaFXJrvjXZk_title=ETL+Scenarios\">ETL Scenarios</a>\n	<p>This article outlines an approach to performing ETL exports to an OpenActuary repository. Motor is used as an example, but the approach is valid elsewhere.</p>\n	</li>\n</ul>','','html',1,'','',0,10436,'Adam OpenUnderwriter','2014-04-23 11:59:36');
